	[2001010201] = {id=2001010201,storyid=20010102,pos=1,description="哈哈~怎么会~我一向是幸运的代言人，区区海浪怎么可能淹死我~",position=1,expression=""},
	[2001010301] = {id=2001010301,storyid=20010103,pos=1,description="好吧，好吧，就你幸运~也不知道是谁不认识路还瞎指挥才害我们冲进暴风雨中心的？",position=2,expression=""},
	[2001010401] = {id=2001010401,storyid=20010104,pos=1,description="啊哈哈~你说什么~我听不清~~~",position=2,expression=""},
	[2001010501] = {id=2001010501,storyid=20010105,pos=1,description="你别装傻！咦~为什么这个城镇一个人也没有？",position=2,expression=""},
	[2001010601] = {id=2001010601,storyid=20010106,pos=1,description="好像是诶~这里空荡荡的~",position=1,expression=""},
	[2001010701] = {id=2001010701,storyid=20010107,pos=1,description="什么东西跑过去了？",position=2,expression=""},
	[2001010801] = {id=2001010801,storyid=20010108,pos=1,description="有人抓了一只小鲜肉~~",position=1,expression=""},
	[2001010901] = {id=2001010901,storyid=20010109,pos=1,description="可恶~竟然把小胖抓进了高塔，一定要马上追上去！",position=2,expression=""},
	[2001011001] = {id=2001011001,storyid=20010110,pos=1,description="小帅哥~看你好像失去了什么心爱之物，需不需要帮忙？",position=1,expression=""},
	[2001011101] = {id=2001011101,storyid=20010111,pos=1,description="当然需要（呃……貌似有什么奇怪的词，算了，救小胖要紧。）",position=2,expression=""},
	[2001020101] = {id=2001020101,storyid=20010201,pos=1,description="哈哈~没想到你追到这里来了~还叫来了帮手~就让我的小弟们陪你们玩玩吧~~",position=1,expression=""},
	[2001020201] = {id=2001020201,storyid=20010202,pos=1,description="再见了~",position=2,expression=""},
	[2001020301] = {id=2001020301,storyid=20010203,pos=1,description="老大慢走~",position=1,expression=""},
	[2001020401] = {id=2001020401,storyid=20010204,pos=1,description="可恶，又被他跑了~",position=2,expression=""},
	[1001030001] = {id=1001030001,storyid=10010300,pos=1,description="没想到被他跑了~",position=2,expression=""},
	[1001030002] = {id=1001030002,storyid=10010300,pos=2,description="嗯~我们可以先稍作休整，升级我们的装备~为下一层做准备~~",position=1,expression=""},
	[1002010001] = {id=1002010001,storyid=10020100,pos=1,description="装备得也差不多了，我们继续往上寻找我的朋友吧~！",position=2,expression=""},
	[1002010002] = {id=1002010002,storyid=10020100,pos=2,description="没问题~~现在就出发吧~！",position=1,expression=""},
	[1002020001] = {id=1002020001,storyid=10020200,pos=1,description="这里没有找到小胖~会不会是~",position=2,expression=""},
	[1002020002] = {id=1002020002,storyid=10020200,pos=2,description="你想多啦~肯定是被拖到更上层去了~我们继续找吧~！",position=1,expression=""},
	[1002020101] = {id=1002020101,storyid=10020201,pos=1,description="我们往更上层去找找吧。",position=2,expression=""},
