	[2002030401] = {id=2002030401,storyid=20020304,pos=1,description="好像有道理~~哎~话说我们这里有人会烹饪嘛~",position=2,expression=""},
	[2002030501] = {id=2002030501,storyid=20020305,pos=1,description="不会~",position=2,expression=""},
