	[2002030801] = {id=2002030801,storyid=20020308,pos=1,description="对了，我记得小镇东方有个招募小岛，上面应该可以找到会烹饪的人才。",position=2,expression=""},
	[2002030901] = {id=2002030901,storyid=20020309,pos=1,description="那就赶紧去吧~~",position=2,expression=""},
