	[2002050801] = {id=2002050801,storyid=20020508,pos=1,description="这么神奇~",position=2,expression=""},
	[2002050901] = {id=2002050901,storyid=20020509,pos=1,description="好~好可怕~",position=2,expression=""},
	[1002040501] = {id=1002040501,storyid=10020405,pos=1,description="咦~我在哪~我在干什么~对了，我好像在追捉走小胖的人犯子…后来的事情怎么想不起来了~！",position=2,expression=""},
	[1002040502] = {id=1002040502,storyid=10020405,pos=2,description="……好像想起来了~我正在吃东西，然后就晕倒了…",position=2,expression=""},
	[1002040503] = {id=1002040503,storyid=10020405,pos=3,description="呃~好~好厉害~吓死宝宝了~",position=1,expression=""},
	[1002040601] = {id=1002040601,storyid=10020406,pos=1,description="原来是这样，还好最后我还是回复了，想想都害怕呢。",position=2,expression=""},
	[1002040602] = {id=1002040602,storyid=10020406,pos=2,description="是啊，不过果然还是不想饿死呢，就算失忆也吃了。",position=1,expression=""},
	[1002040701] = {id=1002040701,storyid=10020407,pos=1,description="这次我们一定要救出小胖。",position=2,expression=""},
	[1002040702] = {id=1002040702,storyid=10020407,pos=2,description="恩恩，干粮也准备充足了，就这样继续往上吧。",position=1,expression=""},
	[1002050001] = {id=1002050001,storyid=10020500,pos=1,description="非常感谢你们的帮助，如果再晚个几天的话，我可能就要长眠在塔里了~",position=2,expression=""},
	[1002050002] = {id=1002050002,storyid=10020500,pos=2,description="嗯~我们只是刚好路过而已~",position=1,expression=""},
	[1002050003] = {id=1002050003,storyid=10020500,pos=3,description="对了恩人，我有个不情之请，希望你们能给我一碗麦饭。",position=2,expression=""},
	[1002050004] = {id=1002050004,storyid=10020500,pos=4,description="麦饭，好像之前在塔里有捡到过……",position=1,expression=""},
	[1002050005] = {id=1002050005,storyid=10020500,pos=5,description="如果你们能给我一碗麦饭的话，我会将我家祖传的宝剑送给你们~",position=2,expression=""},
	[1002050006] = {id=1002050006,storyid=10020500,pos=6,description="这多不好意思呀~",position=1,expression=""},
	[1002050007] = {id=1002050007,storyid=10020500,pos=7,description="不，在生命面前，区区一把宝剑算什么~",position=2,expression=""},
	[1002050008] = {id=1002050008,storyid=10020500,pos=8,description="对了~你们是在找人吗？我在塔里的时候听到有人说过“要赶紧将人送到老大那里去”之类的话~",position=2,expression=""},
	[1003010001] = {id=1003010001,storyid=10030100,pos=1,description="那个乞丐说听见有人要把小胖送给老大，我们得继续往上一层出发了。",position=2,expression=""},
	[1003010002] = {id=1003010002,storyid=10030100,pos=2,description="嗯~我也觉得是这样~希望能追得上那些坏人~~",position=1,expression=""},
	[2003020101] = {id=2003020101,storyid=20030201,pos=1,description="非常感谢你们的帮助，我是无名勇者。",position=2,expression=""},
	[2003020201] = {id=2003020201,storyid=20030202,pos=1,description="勇者怎么会被捉住~",position=2,expression=""},
	[2003020301] = {id=2003020301,storyid=20030203,pos=1,description="说来话长，这是一个忧伤的意外~",position=2,expression=""},
	[2003020401] = {id=2003020401,storyid=20030204,pos=1,description="事情一开始是这样……这样……然后我就饿倒了被他们抓来了，醒来就在在这里了~",position=2,expression=""},
	[2003020501] = {id=2003020501,storyid=20030205,pos=1,description="好吧~你也挺可怜的~",position=2,expression=""},
	[2003030101] = {id=2003030101,storyid=20030301,pos=1,description="可……可恶，居然会这么厉害~~",position=2,expression=""},
	[2003030201] = {id=2003030201,storyid=20030302,pos=1,description="看招~~",position=2,expression=""},
	[2003030301] = {id=2003030301,storyid=20030303,pos=1,description="快跑快跑~~对了，首领说要带谁去见她来着？想不起来了~不管了，随便带个跑吧~",position=2,expression=""},
	[2003030401] = {id=2003030401,storyid=20030304,pos=1,description="哇~~~好浓的烟~~~",position=2,expression=""},
	[2003030501] = {id=2003030501,storyid=20030305,pos=1,description="可恶的强盗又要跑了！",position=2,expression=""},
	[2003030601] = {id=2003030601,storyid=20030306,pos=1,description="那我们快追~~",position=2,expression=""},
	[2003030701] = {id=2003030701,storyid=20030307,pos=1,description="等等，还是先把我的朋友救出来吧~！就是笼子里那只猫。",position=2,expression=""},
	[2003030801] = {id=2003030801,storyid=20030308,pos=1,description="伊维尔的朋友？那我们先把她救出去吧~",position=2,expression=""},
	[1003040001] = {id=1003040001,storyid=10030400,pos=1,description="可恶的强盗，竟然在最后放烟雾弹又把小胖抓走了！",position=2,expression=""},
	[1003040002] = {id=1003040002,storyid=10030400,pos=2,description="呃~这些强盗实在是诡计多端~我们还救出了一个奇怪的东西~~",position=1,expression=""},
	[1004010001] = {id=1004010001,storyid=10040100,pos=1,description="这是什么种族……看着像猫科的兽人？",position=1,expression=""},
	[1004010002] = {id=1004010002,storyid=10040100,pos=2,description="呜咕~呜咕~（不明生物发出来奇怪的声音）",position=2,expression=""},
	[1004010003] = {id=1004010003,storyid=10040100,pos=3,description="唔……她也许需要一些水？",position=1,expression=""},
	[1004020001] = {id=1004020001,storyid=10040200,pos=1,description="……",position=2,expression=""},
	[1004020002] = {id=1004020002,storyid=10040200,pos=2,description="看来只喂水还不够，饿太久了，需要给她吃食物。",position=1,expression=""},
	[1004020101] = {id=1004020101,storyid=10040201,pos=1,description="……",position=2,expression=""},
	[2004030101] = {id=2004030101,storyid=20040301,pos=1,description="……喵？人类？",position=2,expression=""},
	[2004030201] = {id=2004030201,storyid=20040302,pos=1,description="你，你们居然敢这样对待高贵的猫神！！！",position=2,expression=""},
	[2004030301] = {id=2004030301,storyid=20040303,pos=1,description="贝蒂斯，冷静一点",position=2,expression=""},
	[2004030401] = {id=2004030401,storyid=20040304,pos=1,description="闭嘴！就算你们解释我也不会……伊维尔？？？",position=2,expression=""},
	[2004030501] = {id=2004030501,storyid=20040305,pos=1,description="很高兴你还认识我，看你现在的样子，可真是狼狈啊，贝蒂斯~",position=2,expression=""},
	[2004030601] = {id=2004030601,storyid=20040306,pos=1,description="还不是怪可恶的人类……",position=2,expression=""},
	[2004030701] = {id=2004030701,storyid=20040307,pos=1,description="好啦，先别说这些了，我们可还有个人没有救出来呢，刚好又多了个帮手~",position=2,expression=""},
	[2004030801] = {id=2004030801,storyid=20040308,pos=1,description="？？？我不……",position=2,expression=""},
	[2004030901] = {id=2004030901,storyid=20040309,pos=1,description="想必你现在也饿了吧，相信强盗们肯定有储存的小鱼干的",position=2,expression=""},
	[2004031001] = {id=2004031001,storyid=20040310,pos=1,description=" ≖‿≖✧",position=2,expression=""},
	[2004031101] = {id=2004031101,storyid=20040311,pos=1,description="是，是吗？那我们现在就出发吧！",position=2,expression=""},
	[2004031201] = {id=2004031201,storyid=20040312,pos=1,description="٩꒰▽ ꒱۶⁼³₌₃ ",position=2,expression=""},
	[1004040001] = {id=1004040001,storyid=10040400,pos=1,description="哎呀呀……蠢猫就是好骗~那我们一起去找小胖吧~",position=2,expression=""},
	[1004040002] = {id=1004040002,storyid=10040400,pos=2,description="你们不是朋友嘛~这样做真的没问题嘛~？",position=1,expression=""},
	[1004040003] = {id=1004040003,storyid=10040400,pos=3,description="当然没问题~只要有小鱼干就行了~",position=2,expression=""},
	[1005010001] = {id=1005010001,storyid=10050100,pos=1,description="又多了一个帮手~~我可要轻松点了~",position=1,expression=""},
	[1005010002] = {id=1005010002,storyid=10050100,pos=2,description="喵~我可不是帮手~我是高贵的猫神~！",position=2,expression=""},
	[1005020001] = {id=1005020001,storyid=10050200,pos=1,description="不管怎么说，帮忙的人越多越好。",position=2,expression=""},
	[2005030101] = {id=2005030101,storyid=20050301,pos=1,description="居然又追上来了~还好这里是我的地盘~",position=2,expression=""},
	[2005030201] = {id=2005030201,storyid=20050302,pos=1,description="小的们，快出来给我接客~啊呸~是迎客~！",position=2,expression=""},
	[2005030301] = {id=2005030301,storyid=20050303,pos=1,description="汪~~~",position=2,expression=""},
	[2005030401] = {id=2005030401,storyid=20050304,pos=1,description="嘿嘿~老大我来了~~",position=2,expression=""},
	[2005030501] = {id=2005030501,storyid=20050305,pos=1,description="可恶，混蛋强盗又要跑了！",position=2,expression=""},
	[2005030601] = {id=2005030601,storyid=20050306,pos=1,description="你们好好陪陪我的小弟们吧~我就先闪了~~哦哈哈哈~~~",position=2,expression=""},
	[2005040101] = {id=2005040101,storyid=20050401,pos=1,description="哎~又追来了，我接着召唤~小的们上！",position=2,expression=""},
	[2005040201] = {id=2005040201,storyid=20050402,pos=1,description="哈哈~~来了只大的~~不错不错~~我赶紧溜~~",position=2,expression=""},
	[2005040301] = {id=2005040301,storyid=20050403,pos=1,description="汪汪汪~~~",position=2,expression=""},
	[2005040401] = {id=2005040401,storyid=20050404,pos=1,description="老贼，你别跑~~",position=2,expression=""},
	[2005050101] = {id=2005050101,storyid=20050501,pos=1,description="我们好像来到了一个密室~！",position=2,expression=""},
	[2005050201] = {id=2005050201,storyid=20050502,pos=1,description="嗯~这里有个密码锁，需要按照一定的方法触发机关才能打开密码。",position=2,expression=""},
	[2005050301] = {id=2005050301,storyid=20050503,pos=1,description="喵~小鱼干在哪里~~~~",position=2,expression=""},
	[1005060001] = {id=1005060001,storyid=10050600,pos=1,description="可恶~道路居然被炸了~本来都可以救出小胖了。",position=2,expression=""},
	[1005060002] = {id=1005060002,storyid=10050600,pos=2,description="是啊~我们从塔的另一面往上去吧~！",position=1,expression=""},
	[2005070101] = {id=2005070101,storyid=20050701,pos=1,description="这里阴森森的~有点可怕啊~！",position=2,expression=""},
	[2005070201] = {id=2005070201,storyid=20050702,pos=1,description="不要啊啊~~我很怕幽灵的~",position=2,expression=""},
	[2005070301] = {id=2005070301,storyid=20050703,pos=1,description="喵~？幽灵~有小鱼干好吃吗~？",position=2,expression=""},
	[2005070401] = {id=2005070401,storyid=20050704,pos=1,description="你们不用担心，有我呢。",position=2,expression=""},
	[2005080101] = {id=2005080101,storyid=20050801,pos=1,description="呜~~有，有幽灵~~谁来救我啊~~（瑟瑟发抖）",position=2,expression=""},
	[2005080201] = {id=2005080201,storyid=20050802,pos=1,description="别怕，我们来了。",position=2,expression=""},
	[2005080301] = {id=2005080301,storyid=20050803,pos=1,description="快点带我出去吧，我一定会重谢你们的~！呜呜~~",position=2,expression=""},
	[2005080401] = {id=2005080401,storyid=20050804,pos=1,description="你顺着这条路往回走吧，路上的怪物已经被我们干掉了。",position=2,expression=""},
	[2005090101] = {id=2005090101,storyid=20050901,pos=1,description="哈哈~不要问我怎么又进来了~我也很无奈、很绝望啊~~",position=2,expression=""},
	[2005090201] = {id=2005090201,storyid=20050902,pos=1,description="这次我又饿晕了~",position=2,expression=""},
	[2005090301] = {id=2005090301,storyid=20050903,pos=1,description="呵呵……你就不会自己做饭吗？",position=2,expression=""},
	[2005090401] = {id=2005090401,storyid=20050904,pos=1,description="不……不行，我自己做的东西实在太难吃了，我宁愿饿死也不吃自己做的饭~~",position=2,expression=""},
	[2005090501] = {id=2005090501,storyid=20050905,pos=1,description="呃~好吧~",position=2,expression=""},
	[1005100001] = {id=1005100001,storyid=10051000,pos=1,description="之前真的太感谢你们了，你们在找上去的路吗~？~我知道有一条可以通往上层的道路~！",position=2,expression=""},
	[1005100002] = {id=1005100002,storyid=10051000,pos=2,description="哦~我们应该怎么走？",position=1,expression=""},
	[1005100003] = {id=1005100003,storyid=10051000,pos=3,description="这条路可能有点危险~听说那里会有更多幽灵出没~",position=2,expression=""},
	[1005100004] = {id=1005100004,storyid=10051000,pos=4,description="没关系~有再多的幽灵我们都不放在眼里~",position=1,expression=""},
	[1005100005] = {id=1005100005,storyid=10051000,pos=5,description="好吧~那你们小心点。",position=2,expression=""},
	[1006010001] = {id=1006010001,storyid=10060100,pos=1,description="你真的不怕这些幽灵吗？我刚才看你在塔里一直发抖。",position=2,expression=""},
	[1006010002] = {id=1006010002,storyid=10060100,pos=2,description="呜呜~虽然刚才嘴上说了不怕~但我心里还是毛毛的~~~",position=1,expression=""},
	[1006010003] = {id=1006010003,storyid=10060100,pos=3,description="大~家准备好，好了吗？出发吧~我真的不想去啊~（哭~）",position=1,expression=""},
	[2006020101] = {id=2006020101,storyid=20060201,pos=1,description="就算被你们打败了~我也是不会屈服的~~",position=2,expression=""},
	[2006020201] = {id=2006020201,storyid=20060202,pos=1,description="哎，我们只是问个路而已~",position=2,expression=""},
	[2006020301] = {id=2006020301,storyid=20060203,pos=1,description="额~这，这样啊~貌似是我错怪你们了~",position=2,expression=""},
	[2006020401] = {id=2006020401,storyid=20060204,pos=1,description="往那边走就行，我的同伴正在前面对付这些蜘蛛，如果你们看见了请帮助他们~",position=2,expression=""},
	[2006020501] = {id=2006020501,storyid=20060205,pos=1,description="当然可以~！",position=2,expression=""},
	[2006030101] = {id=2006030101,storyid=20060301,pos=1,description="非常感谢你们的帮忙~这样我们就清理完蜘蛛了~有一个任务我们想拜托你们~",position=2,expression=""},
	[2006030201] = {id=2006030201,storyid=20060302,pos=1,description="上一层塔楼来了一只大蜘蛛，把女王的领地给占去了~需要你们去将它干掉",position=2,expression=""},
	[2006030301] = {id=2006030301,storyid=20060303,pos=1,description="如果你们能接受这个任务的话我们就告诉你们通往上层的路~",position=2,expression=""},
	[2006030401] = {id=2006030401,storyid=20060304,pos=1,description="嗯，没问题，包在我们身上吧。",position=2,expression=""},
	[1006040001] = {id=1006040001,storyid=10060400,pos=1,description="呜~没想到我们还接了幽灵给的活儿~~",position=1,expression=""},
	[1006040002] = {id=1006040002,storyid=10060400,pos=2,description="幽灵和蜘蛛打起来了？真是什么怪事都有……",position=2,expression=""},
	[1007010001] = {id=1007010001,storyid=10070100,pos=1,description="让我们去解救女王~？他们为什么不自己去解救~",position=1,expression=""},
	[1007010002] = {id=1007010002,storyid=10070100,pos=2,description="别管那么多了，我们出发吧！",position=2,expression=""},
	[1007010003] = {id=1007010003,storyid=10070100,pos=3,description="好吧~出发解救女王~",position=1,expression=""},
	[2007020101] = {id=2007020101,storyid=20070201,pos=1,description="啊~？原来你们是我的仆人找来的帮手，占领我宫殿的蜘蛛已经被解决了？",position=2,expression=""},
	[2007020201] = {id=2007020201,storyid=20070202,pos=1,description="已经全部清除了，请你告诉我们前进的道路吧~",position=2,expression=""},
	[2007020301] = {id=2007020301,storyid=20070203,pos=1,description="干得不错，我现在就告诉你们往上一层的路在哪里~！",position=2,expression=""},
	[2007020401] = {id=2007020401,storyid=20070204,pos=1,description="谢谢~",position=2,expression=""},
	[2007020501] = {id=2007020501,storyid=20070205,pos=1,description="请等一下~虽然蜘蛛女王被干掉了，但还是有遗留下的其他蜘蛛和蜘蛛捕猎用的陷阱。",position=2,expression=""},
	[2007020601] = {id=2007020601,storyid=20070206,pos=1,description="带上我的守卫吧~他们会帮助你们的~",position=2,expression=""},
	[2007030101] = {id=2007030101,storyid=20070301,pos=1,description="你们看这是什么？",position=2,expression=""},
	[2007030201] = {id=2007030201,storyid=20070302,pos=1,description="让我看看，如果没记错的嘛，应该是小麦种子。",position=2,expression=""},
	[2007030301] = {id=2007030301,storyid=20070303,pos=1,description="种子？是不是可以自己用来种植小麦？",position=2,expression=""},
	[2007030401] = {id=2007030401,storyid=20070304,pos=1,description="是的~不过我们船内现在没有种植室，如果要种植的话，就需要开辟一间种植室。",position=2,expression=""},
	[2007030501] = {id=2007030501,storyid=20070305,pos=1,description="原来如此~~",position=2,expression=""},
	[1007030001] = {id=1007030001,storyid=10070300,pos=1,description="没想到我们还跟女王打了一架~",position=1,expression=""},
	[1007030002] = {id=1007030002,storyid=10070300,pos=2,description="不打不相识嘛~她的守卫应该能在下一层帮我们不少忙。",position=2,expression=""},
	[1007030003] = {id=1007030003,storyid=10070300,pos=3,description="又要打蜘蛛了~我不喜欢蜘蛛~",position=1,expression=""},
	[1007030101] = {id=1007030101,storyid=10070301,pos=1,description="我们将小麦种子进行种植吧，这样就可以制作麦饭了。",position=1,expression=""},
	[1007030102] = {id=1007030102,storyid=10070301,pos=2,description="恩~种植就让我来吧，这方面我还是有点经验的。",position=2,expression=""},
	[1007030103] = {id=1007030103,storyid=10070301,pos=3,description="好~",position=1,expression=""},
	[1007030201] = {id=1007030201,storyid=10070302,pos=1,description="伊维尔居然会种植小麦？",position=1,expression=""},
	[1007030202] = {id=1007030202,storyid=10070302,pos=2,description="恩~没种过小麦，以前经常种植彼岸花之类的，小麦应该类似吧。",position=2,expression=""},
	[1007040001] = {id=1007040001,storyid=10070400,pos=1,description="船长，我们船内的种植室失窃了，被偷了大量的小麦~",position=2,expression=""},
	[1007040002] = {id=1007040002,storyid=10070400,pos=2,description="居然有人敢偷我的东西，哼哼~果然是不知道屎字怎么写~！",position=1,expression=""},
	[1007040003] = {id=1007040003,storyid=10070400,pos=3,description="大家把船门关住，我要把小贼捉出来好好调教下。",position=1,expression=""},
	[1007040004] = {id=1007040004,storyid=10070400,pos=4,description="了解了~我也想看看是谁给偷我辛苦种的小麦。",position=2,expression=""},
	[2007040101] = {id=2007040101,storyid=20070401,pos=1,description="小毛贼，谁给你的狗胆居然来偷我家的小麦~？",position=2,expression=""},
	[2007040201] = {id=2007040201,storyid=20070402,pos=1,description="这位大人，小的不知道是您家的小麦，要是知道了我肯定不敢来偷啊！",position=2,expression=""},
	[2007040301] = {id=2007040301,storyid=20070403,pos=1,description="哼~哼~不管谁给你的狗胆，今天我都要打断你的五肢。",position=2,expression=""},
	[2007040401] = {id=2007040401,storyid=20070404,pos=1,description="哎~~我只有四肢啊~！",position=2,expression=""},
	[2007040501] = {id=2007040501,storyid=20070405,pos=1,description="是嘛~还有一肢是你两腿中间的。",position=2,expression=""},
	[2007040601] = {id=2007040601,storyid=20070406,pos=1,description="啊~！这位大人，手下留情啊，我把我所有的家当都送给你了，求放过。",position=2,expression=""},
	[2007040701] = {id=2007040701,storyid=20070407,pos=1,description="哦~你所有家当有些什么，如果让我满意的话我就放过你。",position=2,expression=""},
	[2007040801] = {id=2007040801,storyid=20070408,pos=1,description="是~是~保证满意~",position=2,expression=""},
	[1007050001] = {id=1007050001,storyid=10070500,pos=1,description="哎呀呀，没想到黑吃黑还可以获得这么多东西。",position=2,expression=""},
	[1007050002] = {id=1007050002,storyid=10070500,pos=2,description="本船长突然希望小毛贼多来几次了。",position=1,expression=""},
	[1007050003] = {id=1007050003,storyid=10070500,pos=3,description="呵呵~~",position=2,expression=""},
	[1008010001] = {id=1008010001,storyid=10080100,pos=1,description="如果准备好了我们就继续前进吧~，这次我们要和幽灵并肩作战。",position=2,expression=""},
	[1008010002] = {id=1008010002,storyid=10080100,pos=2,description="嗯~已经准备好了~",position=1,expression=""},
	[2008020101] = {id=2008020101,storyid=20080201,pos=1,description="上一层就是强盗据点了~我就送你们到这里了~",position=2,expression=""},
	[2008020201] = {id=2008020201,storyid=20080202,pos=1,description="好的，那么再见了~",position=2,expression=""},
	[1008030001] = {id=1008030001,storyid=10080300,pos=1,description="后面的路程就靠我们自己了，大家有没有休息好？",position=2,expression=""},
	[1008030002] = {id=1008030002,storyid=10080300,pos=2,description="没问题~",position=1,expression=""},
	[1008040001] = {id=1008040001,storyid=10080400,pos=1,description="这些蜘蛛网配上海盗还真是麻烦啊！",position=2,expression=""},
	[1008040002] = {id=1008040002,storyid=10080400,pos=2,description="是啊是啊~我飞在半空头上粘了不少蜘蛛网~呜呜~",position=1,expression=""},
	[1008050001] = {id=1008050001,storyid=10080500,pos=1,description="我们有3天没吃饭了，希望这位女侠能给些吃的。",position=2,expression=""},
	[1008050002] = {id=1008050002,storyid=10080500,pos=2,description="嘿嘿~请叫我可爱的船长大人~！",position=1,expression=""},
	[1008050003] = {id=1008050003,storyid=10080500,pos=3,description="呃~可爱的船长大人~请给我们一些吃的。",position=2,expression=""},
	[1008050004] = {id=1008050004,storyid=10080500,pos=4,description="没问题~",position=1,expression=""},
	[1008050101] = {id=1008050101,storyid=10080501,pos=1,description="好吃~好吃~感觉活过来了",position=2,expression=""},
	[1008050201] = {id=1008050201,storyid=10080502,pos=1,description="好吃~好吃~感觉活过来了",position=1,expression=""},
	[1008050301] = {id=1008050301,storyid=10080503,pos=1,description="好吃~好吃~感觉活过来了",position=1,expression=""},
	[2008060101] = {id=2008060101,storyid=20080601,pos=1,description="好吃~好像有种初恋的感觉~呜~这是什么~",position=2,expression=""},
	[2008060201] = {id=2008060201,storyid=20080602,pos=1,description="哎嘿嘿~又能填饱肚子又能忘记痛苦！",position=1,expression=""},
	[1008070001] = {id=1008070001,storyid=10080700,pos=1,description="我兄弟没事吧~？",position=2,expression=""},
	[1008070002] = {id=1008070002,storyid=10080700,pos=2,description="没什么事，吃太多高兴的昏过去了而以。",position=1,expression=""},
	[1009010001] = {id=1009010001,storyid=10090100,pos=1,description="叶小胖就在前面了，马上就可以救到他了，大家准备好了吗？",position=1,expression=""},
	[1009010002] = {id=1009010002,storyid=10090100,pos=2,description="当然！救出朋友！",position=2,expression=""},
	[1009020001] = {id=1009020001,storyid=10090200,pos=1,description="已经准备好了~",position=2,expression=""},
	[1009030001] = {id=1009030001,storyid=10090300,pos=1,description="为了小鱼干而战~~",position=2,expression=""},
	[1009030002] = {id=1009030002,storyid=10090300,pos=2,description="那就出发吧~！",position=1,expression=""},
	[2009040101] = {id=2009040101,storyid=20090401,pos=1,description="强盗，你没处可逃了！",position=2,expression=""},
	[2009040201] = {id=2009040201,storyid=20090402,pos=1,description="我不叫强盗，叫我猎王大人！(╬◣д◢)",position=2,expression=""},
	[2009040301] = {id=2009040301,storyid=20090403,pos=1,description="强盗，快把我朋友交出来！",position=2,expression=""},
	[2009040401] = {id=2009040401,storyid=20090404,pos=1,description="我说了我叫“猎王大人”！你是故意的吧？",position=2,expression=""},
	[2009040501] = {id=2009040501,storyid=20090405,pos=1,description="你们受死吧~！",position=2,expression=""},
	[2009050101] = {id=2009050101,storyid=20090501,pos=1,description="好不容易才打败这个强盗，他真的挺厉害的。",position=2,expression=""},
	[2009050201] = {id=2009050201,storyid=20090502,pos=1,description="他不是强调说他叫“猎王”的吗？",position=2,expression=""},
	[2009050301] = {id=2009050301,storyid=20090503,pos=1,description="这个强盗头目一定把小胖藏到最顶层去了，我们得往上走。",position=2,expression=""},
	[2009050401] = {id=2009050401,storyid=20090504,pos=1,description="我觉得你真的是故意的~",position=2,expression=""},
	[2009060101] = {id=2009060101,storyid=20090601,pos=1,description="呜呜呜~猎王大人死了~！我帮老大把头目要抓的人带来了~呜呜~老大！",position=2,expression=""},
	[2009060201] = {id=2009060201,storyid=20090602,pos=1,description="我要的是那只猫，竟然给我带来个胖子！？真是蠢货，这种废物死了活该~！",position=2,expression=""},
	[2009060301] = {id=2009060301,storyid=20090603,pos=1,description="老大抓，抓错了？！白送了命~",position=2,expression=""},
	[2009060401] = {id=2009060401,storyid=20090604,pos=1,description="有人来了！",position=2,expression=""},
	[2009060501] = {id=2009060501,storyid=20090605,pos=1,description="有人来了！",position=2,expression=""},
	[2009070101] = {id=2009070101,storyid=20090701,pos=1,description="你们竟然敢找上门~？真是不怕死，小的们，给我上！",position=2,expression=""},
	[2009070201] = {id=2009070201,storyid=20090702,pos=1,description="杀啊~！",position=2,expression=""},
	[2009070301] = {id=2009070301,storyid=20090703,pos=1,description="杀~！",position=2,expression=""},
	[2009080101] = {id=2009080101,storyid=20090801,pos=1,description="你……你们赢了~啊~！没想到竟然能打败我堂堂尖刺头目~",position=2,expression=""},
	[2009080201] = {id=2009080201,storyid=20090802,pos=1,description="可是我的生命力是很强的，后会有期了，小鬼们~~~",position=2,expression=""},
	[2009080301] = {id=2009080301,storyid=20090803,pos=1,description="别跑~！！",position=2,expression=""},
	[2009090101] = {id=2009090101,storyid=20090901,pos=1,description="终于把这胖子从牢房里面拖出来了，累死我了。",position=2,expression=""},
	[2009090201] = {id=2009090201,storyid=20090902,pos=1,description="喂~起来了~",position=2,expression=""},
	[2009090301] = {id=2009090301,storyid=20090903,pos=1,description="啊~？强盗呢~？",position=2,expression=""},
	[2009090401] = {id=2009090401,storyid=20090904,pos=1,description="强盗被我们打跑了，话说你还真是能睡啊！",position=2,expression=""},
	[2009090501] = {id=2009090501,storyid=20090905,pos=1,description="喵~楼上打得叮咣响都没把你吵醒~懒猪~~",position=2,expression=""},
	[1009100001] = {id=1009100001,storyid=10091000,pos=1,description="多亏了你被抓走，这架打得可真是过瘾~",position=1,expression=""},
	[1009100002] = {id=1009100002,storyid=10091000,pos=2,description="额……可惜最后让那个头目跑了，要不是我一直被关着，我一定饶不了她~！！",position=2,expression=""},
	[1010010001] = {id=1010010001,storyid=10100100,pos=1,description="呜呼~~小胖终于被救出来了，我可爱的船啊，还差一些没修好~",position=1,expression=""},
	[1010010002] = {id=1010010002,storyid=10100100,pos=2,description="还不是你自己把船开进了风暴里，算了~这里正好有很多木材，我们都来帮忙吧！",position=2,expression=""},
	[2010020101] = {id=2010020101,storyid=20100201,pos=1,description="加油~！加油~！",position=2,expression=""},
	[1010030001] = {id=1010030001,storyid=10100300,pos=1,description="哦吼吼~~我超级超级美丽的船啊~你终于被修好了~我一定会好好爱护你的~",position=1,expression=""},
	[1010030002] = {id=1010030002,storyid=10100300,pos=2,description="我信你才怪~你到时候一定又瞎开船~！",position=2,expression=""},
	[1011010001] = {id=1011010001,storyid=10110100,pos=1,description="我需要把小胖送回家，我们俩离开美食岛太久了。",position=2,expression=""},
	[1011010002] = {id=1011010002,storyid=10110100,pos=2,description="没问题~准备妥当了就出发回美食岛~",position=1,expression=""},
	[1011020001] = {id=1011020001,storyid=10110200,pos=1,description="船虽然修好了，但里面实在太小了，没有我可以待的地方了~",position=2,expression=""},
	[1011020002] = {id=1011020002,storyid=10110200,pos=2,description="嗯~没关系，我们可以扩充休息室，增加登船人数~",position=1,expression=""},
	[2011030101] = {id=2011030101,storyid=20110301,pos=1,description="终于增加了船里的空间，也修好了船~小胖你能上船了~~",position=2,expression=""},
	[2011030201] = {id=2011030201,storyid=20110302,pos=1,description="能上船是能上船，可是我没有睡觉的地方啊~我可是很爱睡觉的~",position=2,expression=""},
	[2011030301] = {id=2011030301,storyid=20110303,pos=1,description="啊！？少了张床吗？看来还得多准备个床",position=2,expression=""},
	[2011040101] = {id=2011040101,storyid=20110401,pos=1,description="我的床终于造好了~我在塔里的地板上躺了这么久终于能睡个好觉了！",position=2,expression=""},
	[2011040201] = {id=2011040201,storyid=20110402,pos=1,description="嗯~你一个人的床顶得上两个人了~",position=2,expression=""},
	[2011040301] = {id=2011040301,storyid=20110403,pos=1,description="额……你这床可真够大的~",position=2,expression=""},
	[2011050101] = {id=2011050101,storyid=20110501,pos=1,description="一切都没问题了~“船长大人最可爱号”可以出发了~",position=2,expression=""},
	[2011050201] = {id=2011050201,storyid=20110502,pos=1,description="这艘船算是新生了，不应该叫原来的名字~我看就改名叫“伊维尔女王号”吧~！",position=2,expression=""},
	[2011050301] = {id=2011050301,storyid=20110503,pos=1,description="这些名字都不好，应该叫“勇者李凡号”，这样最好听。",position=2,expression=""},
	[2011050401] = {id=2011050401,storyid=20110504,pos=1,description="还是叫“肉包号”吧~表达了对大家永远不饿肚子的美好期盼。",position=2,expression=""},
	[2011050501] = {id=2011050501,storyid=20110505,pos=1,description="喵呜~你们这些俗人~应该听本喵的，叫“喵喵号”~~",position=2,expression=""},
	[1011060001] = {id=1011060001,storyid=10110600,pos=1,description="大家都准备好了，我们可以出发了！",position=2,expression=""},
	[1011060002] = {id=1011060002,storyid=10110600,pos=2,description="那我们走吧~！",position=1,expression=""},
	[2011070101] = {id=2011070101,storyid=20110701,pos=1,description="停，停，停下！我要晕倒了，她到底会不会开船啊~Σ(っ°Д°;)っ",position=2,expression=""},
	[2011070201] = {id=2011070201,storyid=20110702,pos=1,description="到底是谁给她发的船长证？加勒比海盗吗？",position=2,expression=""},
	[2011070301] = {id=2011070301,storyid=20110703,pos=1,description="额……我已经习惯了，你应该问问我们之前是为什么才到骑士岛的~",position=2,expression=""},
	[2011070401] = {id=2011070401,storyid=20110704,pos=1,description="嘤~！我也不想这样啊！这个舵不受控制了~~！",position=2,expression=""},
	[2011070501] = {id=2011070501,storyid=20110705,pos=1,description="喵~本猫已经晕了⊙▃⊙",position=2,expression=""},
	[2011070601] = {id=2011070601,storyid=20110706,pos=1,description="要不停下把船长室修一下吧，给她加个高级的船舵，要不我们还没到家就要葬身在海上了~",position=2,expression=""},
	[2011070701] = {id=2011070701,storyid=20110707,pos=1,description="快点帮我升级船长室~我开不好船就是因为船长室不够高级~~",position=2,expression=""},
	[2011070801] = {id=2011070801,storyid=20110708,pos=1,description="……（无语~~）",position=2,expression=""},
	[2011080101] = {id=2011080101,storyid=20110801,pos=1,description="嘿嘿~升级了船长室后我的开船技术不就上升了吗？说明之前是硬件不到位~~",position=2,expression=""},
	[2011080201] = {id=2011080201,storyid=20110802,pos=1,description="额……你们看Σ(っ°Д°;)っ",position=2,expression=""},
	[2011080301] = {id=2011080301,storyid=20110803,pos=1,description="那边有一个海盗船！我们去黑吃黑吧~？嘿嘿~~",position=2,expression=""},
	[2011080401] = {id=2011080401,storyid=20110804,pos=1,description="嗯，这样不好吧，我们不是正经商船吗？",position=2,expression=""},
	[2011080501] = {id=2011080501,storyid=20110805,pos=1,description="本喵要抢海盗的金子~喵~",position=2,expression=""},
	[2011080601] = {id=2011080601,storyid=20110806,pos=1,description="谁说我们是商船了~？只要有钱我们什么都干的~船长都发话了~冲啊~",position=2,expression=""},
	[2011080701] = {id=2011080701,storyid=20110807,pos=1,description="额……那好吧……",position=2,expression=""},
	[2011090101] = {id=2011090101,storyid=20110901,pos=1,description="不好，我们的船撞到东西了！",position=2,expression=""},
	[2011090201] = {id=2011090201,storyid=20110902,pos=1,description="是一艘沉船~喵~",position=2,expression=""},
	[2011090301] = {id=2011090301,storyid=20110903,pos=1,description="沉船~！",position=2,expression=""},
	[2011090401] = {id=2011090401,storyid=20110904,pos=1,description="里面一定有很多财宝~快来个人下去打捞~小胖，就你了~！",position=2,expression=""},
	[2011090501] = {id=2011090501,storyid=20110905,pos=1,description="啊？",position=2,expression=""},
	[2011090601] = {id=2011090601,storyid=20110906,pos=1,description="啊什么啊~你就当减肥了~come on~my precious~~",position=2,expression=""},
	[1011100001] = {id=1011100001,storyid=10111000,pos=1,description="这里发生了什么，你怎么变成这样了~？",position=1,expression=""},
	[1011100002] = {id=1011100002,storyid=10111000,pos=2,description="这里发生了疫病，所有的食物都被污染了，被绿色的粘液污染了~",position=2,expression=""},
	[1012010001] = {id=1012010001,storyid=10120100,pos=1,description="食物被污染了，这怎么会……",position=1,expression=""},
	[1012010002] = {id=1012010002,storyid=10120100,pos=2,description="我和小胖离开才没几天，怎么会发生这样的事情~？",position=2,expression=""},
	[1012020001] = {id=1012020001,storyid=10120200,pos=1,description="这事一定有蹊跷，我们得去调查看看~",position=2,expression=""},
	[1012020002] = {id=1012020002,storyid=10120200,pos=2,description="好~那我们一起去看看吧~！",position=1,expression=""},
	[2012030101] = {id=2012030101,storyid=20120301,pos=1,description="这些桶里的东西就是疫病的来源？",position=2,expression=""},
	[2012030201] = {id=2012030201,storyid=20120302,pos=1,description="一定是的，那些发疯的蝙蝠嘴角都有这些绿色的粘液，一定是吃了这个。",position=2,expression=""},
	[2012030301] = {id=2012030301,storyid=20120303,pos=1,description="这些可恶的海盗，他们为什么要制造这些东西~~？",position=2,expression=""},
	[2012030401] = {id=2012030401,storyid=20120304,pos=1,description="刚才被被蝙蝠咬了一口，我现在感觉头有点晕",position=2,expression=""},
	[1012040001] = {id=1012040001,storyid=10120400,pos=1,description="看来瘟疫蔓延的很快，大多数食物和村民都中毒了~",position=2,expression=""},
	[1013010001] = {id=1013010001,storyid=10130100,pos=1,description="我们得想办法解决美食城的瘟疫问题",position=2,expression=""},
	[2013020101] = {id=2013020101,storyid=20130201,pos=1,description="美食城的食物全部都中毒了，如果没法解决食物问题的话，村民们会死。",position=2,expression=""},
	[2013020201] = {id=2013020201,storyid=20130202,pos=1,description="哈哈~我果然是天才~嘿嘿~我们可以烹饪来进行出售。",position=2,expression=""},
	[2013020301] = {id=2013020301,storyid=20130203,pos=1,description="咦~这主意不错，我们有自己的种植室，种出的东西都没有毒，看来村民有救了。",position=2,expression=""},
	[2013020401] = {id=2013020401,storyid=20130204,pos=1,description="哈哈~这不是重点，赚钱才是重点，没错~我要开店进行营业，吃咱们的食物需要付费，我们现在开始营业餐厅。",position=2,expression=""},
	[2013020501] = {id=2013020501,storyid=20130205,pos=1,description="不太好吧~孟姜的烹饪会让人失忆。",position=2,expression=""},
	[2013020601] = {id=2013020601,storyid=20130206,pos=1,description="不是还有小胖嘛~嘿嘿~",position=2,expression=""},
	[2013020701] = {id=2013020701,storyid=20130207,pos=1,description="恩~烹饪我好像会些，但好像咱们船内没有桌椅进行营业呢！",position=2,expression=""},
	[2013020801] = {id=2013020801,storyid=20130208,pos=1,description="如果只是桌椅的话我想我应该可以制作。",position=2,expression=""},
	[2013020901] = {id=2013020901,storyid=20130209,pos=1,description="那就这样说定了~赶紧开始忙活吧！",position=2,expression=""},
	[2013021001] = {id=2013021001,storyid=20130210,pos=1,description="好~",position=2,expression=""},
	[1013030001] = {id=1013030001,storyid=10130300,pos=1,description="烹饪完成了，我们还需要一个可以进行就餐的餐桌。",position=2,expression=""},
	[1013030002] = {id=1013030002,storyid=10130300,pos=2,description="那就让李凡来做吧。",position=1,expression=""},
	[1013030101] = {id=1013030101,storyid=10130301,pos=1,description="制作餐桌就包在我身上吧。",position=2,expression=""},
	[1013030201] = {id=1013030201,storyid=10130302,pos=1,description="餐桌制作完成还需要一些时间，请耐心等待。",position=2,expression=""},
	[1013030301] = {id=1013030301,storyid=10130303,pos=1,description="餐桌已经制作完成，我们现在将它放入餐厅吧。",position=2,expression=""},
	[1013030401] = {id=1013030401,storyid=10130304,pos=1,description="这样村民们应该就会慢慢回复健康了！",position=2,expression=""},
	[1013040001] = {id=1013040001,storyid=10130400,pos=1,description="我们的餐厅太简陋了，如果想要赚到大钱的话，还需要将餐厅装修下。",position=1,expression=""},
	[1013040002] = {id=1013040002,storyid=10130400,pos=2,description="我也同意，我再制作几件家具来装修下吧。",position=2,expression=""},
	[1013050001] = {id=1013050001,storyid=10130500,pos=1,description="制作家具还需要一段时间，请等待。",position=2,expression=""},
	[2014010101] = {id=2014010101,storyid=20140101,pos=1,description="呃~为什么感觉全身无力了，不是才刚吃完食物嘛！！！",position=2,expression=""},
	[2014010201] = {id=2014010201,storyid=20140102,pos=1,description="呜~我也有点难受~~~",position=2,expression=""},
	[2014010301] = {id=2014010301,storyid=20140103,pos=1,description="好晕~~",position=2,expression=""},
	[1014010001] = {id=1014010001,storyid=10140100,pos=1,description="我突然想起一件事情！！",position=2,expression=""},
	[1014010002] = {id=1014010002,storyid=10140100,pos=2,description="什么事件~？",position=1,expression=""},
	[1014010003] = {id=1014010003,storyid=10140100,pos=3,description="好像吃了我烹饪食物的人会中毒，反正我自己没中过毒。",position=2,expression=""},
	[1014010004] = {id=1014010004,storyid=10140100,pos=4,description="哎~还有这事，得去看看村民有没有中毒。",position=1,expression=""},
	[1014010101] = {id=1014010101,storyid=10140101,pos=1,description="呜~我是怎么了~好难受~",position=2,expression=""},
	[1014010201] = {id=1014010201,storyid=10140102,pos=1,description="呜~我感觉我要死了~外婆在向我召唤~",position=2,expression=""},
	[1014010301] = {id=1014010301,storyid=10140103,pos=1,description="……好困……让我先睡会…",position=2,expression=""},
	[1014010401] = {id=1014010401,storyid=10140104,pos=1,description="大…大事不好，村民们都中毒了，小胖你有什么办法没？",position=1,expression=""},
	[1014010402] = {id=1014010402,storyid=10140104,pos=2,description="恩~好像以前有人吃了我烹饪中毒了后，都是我陈叔帮忙治好的~",position=2,expression=""},
	[1014010403] = {id=1014010403,storyid=10140104,pos=3,description="那就赶紧去找你陈叔吧~",position=1,expression=""},
	[1014010404] = {id=1014010404,storyid=10140104,pos=4,description="恩~陈叔好像在上层的农田。",position=2,expression=""},
	[1014010501] = {id=1014010501,storyid=10140105,pos=1,description="村民们有救出，我们快去做解毒菜吧！",position=2,expression=""},
	[2014020101] = {id=2014020101,storyid=20140201,pos=1,description="那些绿色的食物怎么越吃越饿啊~我饿~",position=2,expression=""},
	[2014020201] = {id=2014020201,storyid=20140202,pos=1,description="我们这有吃的，赶紧吃了吧~",position=2,expression=""},
	[2014020301] = {id=2014020301,storyid=20140203,pos=1,description="我受不了了~！",position=2,expression=""},
	[2014020401] = {id=2014020401,storyid=20140204,pos=1,description="哇嗷~！给我更多食物~！！",position=2,expression=""},
	[2014020501] = {id=2014020501,storyid=20140205,pos=1,description="她一定是吃了那些带绿色粘液的食物~！",position=2,expression=""},
	[1014030001] = {id=1014030001,storyid=10140300,pos=1,description="原来那些海盗的桶里装的粘液就是一切瘟疫的来源~村民吃了被粘液污染的食物就会变狂~",position=1,expression=""},
	[1014030002] = {id=1014030002,storyid=10140300,pos=2,description="这似乎是有人为了控制村民专门研制出来的毒药~，这一切的源头就是这个。",position=2,expression=""},
	[1014040001] = {id=1014040001,storyid=10140400,pos=1,description="可恶~我叔叔的农场一定也遭到破坏了，不知道他怎么样了~",position=2,expression=""},
	[1014040002] = {id=1014040002,storyid=10140400,pos=2,description="我们赶紧出发去救你叔叔吧~",position=1,expression=""},
	[2014050101] = {id=2014050101,storyid=20140501,pos=1,description="这些人都发疯了，多亏了你们帮忙才打败他们。",position=2,expression=""},
	[2014050201] = {id=2014050201,storyid=20140502,pos=1,description="小，小胖~！？你不是被抓走了吗？",position=2,expression=""},
	[2014050301] = {id=2014050301,storyid=20140503,pos=1,description="李凡把我救出来了，那些可恶的海盗，这些瘟疫也是他们搞的鬼~",position=2,expression=""},
	[2014050401] = {id=2014050401,storyid=20140504,pos=1,description="海盗背后应该还有什么人在指挥他们。",position=2,expression=""},
	[2014050501] = {id=2014050501,storyid=20140505,pos=1,description="我们先离开这里再说。",position=2,expression=""},
	[1014060001] = {id=1014060001,storyid=10140600,pos=1,description="嗯~陈叔，这段时间到底发生了什么~？",position=1,expression=""},
	[1014060002] = {id=1014060002,storyid=10140600,pos=2,description="你就是小胖口中那个不会开船的船长吧？",position=2,expression=""},
	[1014060003] = {id=1014060003,storyid=10140600,pos=3,description="额……是我~~（叶小胖你竟敢这么说我，你死定了！！！）",position=1,expression=""},
	[1014060004] = {id=1014060004,storyid=10140600,pos=4,description="最开始是有人发现了一些奇怪的桶，然后所有的食物都被污染了。",position=2,expression=""},
	[1014060005] = {id=1014060005,storyid=10140600,pos=5,description="吃了污染食物的人会发狂变得有攻击性，不吃的话就得挨饿。",position=2,expression=""},
	[1014060006] = {id=1014060006,storyid=10140600,pos=6,description="那些饥民总有一天也会受不了然后去吃那些被污染的食物的。",position=2,expression=""},
	[1014070001] = {id=1014070001,storyid=10140700,pos=1,description="小胖叔，这些村民吃了小胖的食物后全部中毒了，我们应该怎么办解毒？",position=1,expression=""},
	[1014070002] = {id=1014070002,storyid=10140700,pos=2,description="你们在我农场里找到的菜谱和胡萝卜种子就是可以解毒的。",position=2,expression=""},
	[1014070003] = {id=1014070003,storyid=10140700,pos=3,description="原来是这样。",position=1,expression=""},
	[1014080001] = {id=1014080001,storyid=10140800,pos=1,description="看来村民们身上的毒都解除了。",position=2,expression=""},
	[1014080002] = {id=1014080002,storyid=10140800,pos=2,description="哼~毒是解掉了，但少赚了好多钱，我要打死小胖来消我失去金币的痛。",position=1,expression=""},
	[2014090101] = {id=2014090101,storyid=20140901,pos=1,description="笨蛋小胖，这种事情都不提早说，害的我们少赚了这么多钱。",position=2,expression=""},
	[2014090201] = {id=2014090201,storyid=20140902,pos=1,description="我也没办法呀，我自己吃又不会中毒，一下子想不起来这种不重要的事情。",position=2,expression=""},
	[2014090301] = {id=2014090301,storyid=20140903,pos=1,description="说起这件事，让我想起来天赋。",position=2,expression=""},
	[2014090401] = {id=2014090401,storyid=20140904,pos=1,description="天赋是什么？",position=2,expression=""},
	[2014090501] = {id=2014090501,storyid=20140905,pos=1,description="每个人都有天赋，天赋有好有坏，如果我没记错的吧，不胖应该拥有食神的天赋，可以消化一切食物，不受任何毒素。",position=2,expression=""},
	[2014090601] = {id=2014090601,storyid=20140906,pos=1,description="这么神奇，那我们的天赋是什么？",position=2,expression=""},
	[2014090701] = {id=2014090701,storyid=20140907,pos=1,description="如果想知道天赋是什么，就进行天赋训练~我知道一种训练方法。",position=2,expression=""},
	[2014090801] = {id=2014090801,storyid=20140908,pos=1,description="那我们快去训练吧！",position=2,expression=""},
	[1014100001] = {id=1014100001,storyid=10141000,pos=1,description="那我们开始进行天赋训练吧。",position=2,expression=""},
	[1014100002] = {id=1014100002,storyid=10141000,pos=2,description="必须好好训练，我要知道自己的天赋是什么。",position=1,expression=""},
	[1014110001] = {id=1014110001,storyid=10141100,pos=1,description="不错，没想到大家都将天赋激发出来了。",position=2,expression=""},
	[1014110002] = {id=1014110002,storyid=10141100,pos=2,description="哦~感觉有了天赋后，整个人都变得更加强大了。",position=1,expression=""},
	[1015010001] = {id=1015010001,storyid=10150100,pos=1,description="呜~那岂不是一个死循环了~~",position=1,expression=""},
	[1015010002] = {id=1015010002,storyid=10150100,pos=2,description="哦~@！我忽然想起一件事~",position=2,expression=""},
	[1015010003] = {id=1015010003,storyid=10150100,pos=3,description="我农场的地下室里有一些没有被污染的种子。我们可以自己种植粮食，做成食物给饥民吃。",position=2,expression=""},
	[1015010004] = {id=1015010004,storyid=10150100,pos=4,description="这样就能阻止瘟疫的扩散了~~！我们赶紧出发吧~",position=1,expression=""},
	[2015020101] = {id=2015020101,storyid=20150201,pos=1,description="这里也有变异的饥民？",position=2,expression=""},
	[2015020201] = {id=2015020201,storyid=20150202,pos=1,description="不好！种子库被人入侵了~有人想污染种子。",position=2,expression=""},
	[2015020301] = {id=2015020301,storyid=20150203,pos=1,description="说不定入侵的人就是这一切的幕后黑手。",position=2,expression=""},
	[2015020401] = {id=2015020401,storyid=20150204,pos=1,description="我们快点去种子室~",position=2,expression=""},
	[2015030101] = {id=2015030101,storyid=20150301,pos=1,description="你们就是最近在调查的那拨人吧~？",position=2,expression=""},
	[2015030201] = {id=2015030201,storyid=20150302,pos=1,description="竟然追到这里了，我可没空跟你们耗时间。饥民们，给我上~~",position=2,expression=""},
	[2015030301] = {id=2015030301,storyid=20150303,pos=1,description="啊~~受不了了~",position=2,expression=""},
	[2015030401] = {id=2015030401,storyid=20150304,pos=1,description="啊~我要吃~",position=2,expression=""},
	[2015030501] = {id=2015030501,storyid=20150305,pos=1,description="厨师长！？这一切都是你搞的鬼！",position=2,expression=""},
	[2015030601] = {id=2015030601,storyid=20150306,pos=1,description="那些种子都是我的了~再见~~",position=2,expression=""},
	[2015030701] = {id=2015030701,storyid=20150307,pos=1,description="别跑！",position=2,expression=""},
	[2015040101] = {id=2015040101,storyid=20150401,pos=1,description="差点就把种子弄到手了~",position=2,expression=""},
	[2015040201] = {id=2015040201,storyid=20150402,pos=1,description="竟敢坏了我的好事~你们这废物饥民，快给我变身~",position=2,expression=""},
	[2015040301] = {id=2015040301,storyid=20150403,pos=1,description="啊~我要吃~",position=2,expression=""},
	[2015040401] = {id=2015040401,storyid=20150404,pos=1,description="啊~吃~",position=2,expression=""},
	[2015040501] = {id=2015040501,storyid=20150405,pos=1,description="我就先走了~你们好好对付这些魔化的人吧~哈哈~",position=2,expression=""},
	[2015040601] = {id=2015040601,storyid=20150406,pos=1,description="你就是疫病的凶手，给我站住~！",position=2,expression=""},
	[1015050001] = {id=1015050001,storyid=10150500,pos=1,description="我们终于找到没被污染的种子了，这些麦子能做不少馒头呢~",position=2,expression=""},
	[1015050002] = {id=1015050002,storyid=10150500,pos=2,description="嗯~饥民有救了~~耶~",position=1,expression=""},
	[1015050003] = {id=1015050003,storyid=10150500,pos=3,description="嘿嘿~我顺便还能小赚一笔（招募岛可花了我不少银子~~我的心好痛~）",position=1,expression=""},
	[1015050004] = {id=1015050004,storyid=10150500,pos=4,description="我们赶紧开始做起来吧，待会就在码头上开张~",position=2,expression=""},
	[2015060101] = {id=2015060101,storyid=20150601,pos=1,description="香喷喷的美食~快来吃啊~没有被污染的美食~",position=2,expression=""},
	[2015060201] = {id=2015060201,storyid=20150602,pos=1,description="喵~本喵都被推出来招客了~客人们快来吃啊~",position=2,expression=""},
	[2015060301] = {id=2015060301,storyid=20150603,pos=1,description="花了我不少功夫才做好这些食物，镇子里的人有救了~",position=2,expression=""},
	[2015060401] = {id=2015060401,storyid=20150604,pos=1,description="给我……来一个馒头~",position=2,expression=""},
	[2015060501] = {id=2015060501,storyid=20150605,pos=1,description="啊，呸~这么难吃，与其被你们的东西难吃死，我情愿去吃被污染的食物！",position=2,expression=""},
	[2015060601] = {id=2015060601,storyid=20150606,pos=1,description="啊~？",position=2,expression=""},
	[2015060701] = {id=2015060701,storyid=20150607,pos=1,description="这么难吃还敢出来卖~！大家给我把这破摊子砸了~~！",position=2,expression=""},
	[2015060801] = {id=2015060801,storyid=20150608,pos=1,description="砸了~！砸了~！",position=2,expression=""},
	[1015070001] = {id=1015070001,storyid=10150700,pos=1,description="嘤~嘤~嘤~~",position=1,expression=""},
	[1015070002] = {id=1015070002,storyid=10150700,pos=2,description="怎么会这样，东西都被砸了~（没赚到钱还赔了不少~~！）",position=1,expression=""},
	[1015070003] = {id=1015070003,storyid=10150700,pos=3,description="这些饥民不喜欢我们做的食物。",position=2,expression=""},
	[1016010001] = {id=1016010001,storyid=10160100,pos=1,description="客人的事情告一段落，我们得断续解决塔内毒素的问题。",position=2,expression=""},
	[1016010002] = {id=1016010002,storyid=10160100,pos=2,description="恩~我们继续前往上一层吧。",position=1,expression=""},
	[2016020101] = {id=2016020101,storyid=20160201,pos=1,description="你们这些强盗，我死也不会吧餐厅交给你们的",position=2,expression=""},
	[2016020201] = {id=2016020201,storyid=20160202,pos=1,description="那你就去死吧~",position=2,expression=""},
	[2016020301] = {id=2016020301,storyid=20160203,pos=1,description="别怕，有我们呢~！",position=2,expression=""},
	[2016030101] = {id=2016030101,storyid=20160301,pos=1,description="虽然你们救了我，但想拿到我的美食食谱我还得给你们出个考验~",position=2,expression=""},
	[2016030201] = {id=2016030201,storyid=20160302,pos=1,description="什么考验呢？",position=2,expression=""},
	[2016030301] = {id=2016030301,storyid=20160303,pos=1,description="这里有一些食材，你们得正确使用这些东西做出三个包子。",position=2,expression=""},
	[2016030401] = {id=2016030401,storyid=20160304,pos=1,description="你们做出了包子我就把我家传的种子给你们，这个可是绝密哦~~",position=2,expression=""},
	[1016040001] = {id=1016040001,storyid=10160400,pos=1,description="这难道是大米种子，我们居然拥有了大米种子。",position=1,expression=""},
	[1016040002] = {id=1016040002,storyid=10160400,pos=2,description="好东西啊，看来我们不会因为缺少干粮而不得不重新回到起点了。",position=2,expression=""},
	[1016050001] = {id=1016050001,storyid=10160500,pos=1,description="有了大米我们就可以自己种植来制作饭团了。",position=2,expression=""},
	[1016050002] = {id=1016050002,storyid=10160500,pos=2,description="有了饭团我们就可以长时间的在外战斗时补充体力了。",position=1,expression=""},
	[1016050003] = {id=1016050003,storyid=10160500,pos=3,description="是的，我们赶紧开始种植吧，我已经等不及那时候的到来了。",position=2,expression=""},
	[1016050101] = {id=1016050101,storyid=10160501,pos=1,description="种植完成了，接下来是干粮的制作。",position=2,expression=""},
	[1016050201] = {id=1016050201,storyid=10160502,pos=1,description="现在可以进行干粮制作了。",position=2,expression=""},
	[1016060001] = {id=1016060001,storyid=10160600,pos=1,description="虽然可以自己种植大米，可惜大米有个成长周期，无法无限地种下去。",position=2,expression=""},
	[1016060002] = {id=1016060002,storyid=10160600,pos=2,description="恩，已经不错了。",position=1,expression=""},
	[1016060003] = {id=1016060003,storyid=10160600,pos=3,description="说的也是。",position=2,expression=""},
	[1017010001] = {id=1017010001,storyid=10170100,pos=1,description="我觉得我们的餐厅还不够豪华，只要够豪华，可以赚更多的钱。",position=2,expression=""},
	[1017010002] = {id=1017010002,storyid=10170100,pos=2,description="赚钱我最喜欢了，快说怎么可以更豪华。",position=1,expression=""},
	[1017010003] = {id=1017010003,storyid=10170100,pos=3,description="我知道有个豪华的餐厅，那里应该会有很多装饰物，我们去偷一些回来。",position=2,expression=""},
	[1017010004] = {id=1017010004,storyid=10170100,pos=4,description="笨蛋小胖，赚钱的事情能叫偷嘛~话说你怎么知道哪里有豪华餐厅的。",position=1,expression=""},
	[1017010005] = {id=1017010005,storyid=10170100,pos=5,description="嘿嘿~为了吃遍美食，基本岛上所有能去吃的地方我都去过。",position=2,expression=""},
	[1017020001] = {id=1017020001,storyid=10170200,pos=1,description="李凡你看看，这些材料能不能做出什么来~？",position=1,expression=""},
	[1017020002] = {id=1017020002,storyid=10170200,pos=2,description="恩~好像可以再制作个盆栽，还可以制作精美的窗户。",position=2,expression=""},
	[1017020003] = {id=1017020003,storyid=10170200,pos=3,description="那咱们赶紧做吧。",position=1,expression=""},
	[2017030101] = {id=2017030101,storyid=20170301,pos=1,description="嗝~继续喝~五魁手，六六六~",position=2,expression=""},
	[2017030201] = {id=2017030201,storyid=20170302,pos=1,description="这就是外面那个酒鬼说的姐妹吧~一家都是酒鬼~",position=2,expression=""},
	[2017030301] = {id=2017030301,storyid=20170303,pos=1,description="别喝啦~你们的姐妹在门外等着呢~快去找她吧~~",position=2,expression=""},
	[2017030401] = {id=2017030401,storyid=20170304,pos=1,description="嗝~我就说好像少了一个人……",position=2,expression=""},
	[2017030501] = {id=2017030501,storyid=20170305,pos=1,description="你们把这瓶酒带给她吧，嗝~我们俩在这继续喝~",position=2,expression=""},
	[2017030601] = {id=2017030601,storyid=20170306,pos=1,description="还好她们只是喝酒……并没有变异的样子~",position=2,expression=""},
	[2017040101] = {id=2017040101,storyid=20170401,pos=1,description="别，别过来~！",position=2,expression=""},
	[2017040201] = {id=2017040201,storyid=20170402,pos=1,description="更多的吃的~嗯，一只大肥猪？我要吃掉你~~",position=2,expression=""},
	[2017040301] = {id=2017040301,storyid=20170403,pos=1,description="怎么了~？",position=2,expression=""},
	[2017040401] = {id=2017040401,storyid=20170404,pos=1,description="她跳着跳着就变身了",position=2,expression=""},
	[2017040501] = {id=2017040501,storyid=20170405,pos=1,description="啊~",position=2,expression=""},
	[2017050101] = {id=2017050101,storyid=20170501,pos=1,description="我感觉不对劲……",position=2,expression=""},
	[2017050201] = {id=2017050201,storyid=20170502,pos=1,description="帮主，你怎么了！",position=2,expression=""},
	[2017050301] = {id=2017050301,storyid=20170503,pos=1,description="帮主~！",position=2,expression=""},
	[2017050401] = {id=2017050401,storyid=20170504,pos=1,description="呜~（喘气）是不是你们给我下的毒~！！",position=2,expression=""},
	[2017050501] = {id=2017050501,storyid=20170505,pos=1,description="啊~？我们？我们也是才到的~",position=2,expression=""},
	[2017050601] = {id=2017050601,storyid=20170506,pos=1,description="一定是你们，萧峰，就是你下的毒~",position=2,expression=""},
	[2017050701] = {id=2017050701,storyid=20170507,pos=1,description="喵~？你走错片场了吧？",position=2,expression=""},
	[2017050801] = {id=2017050801,storyid=20170508,pos=1,description="我忽然也感觉肚子不舒服了~啊~",position=2,expression=""},
	[2017050901] = {id=2017050901,storyid=20170509,pos=1,description="啊~",position=2,expression=""},
	[2017060101] = {id=2017060101,storyid=20170601,pos=1,description="原来是我错怪你们了吗？到底是谁把我关在这里的……",position=2,expression=""},
	[2017060201] = {id=2017060201,storyid=20170602,pos=1,description="是那些可恶的海贼。",position=2,expression=""},
	[2017060301] = {id=2017060301,storyid=20170603,pos=1,description="我浑身冻得不行，你们能给我做碗热粥吗？这里有小麦，还需要一些鸡蛋和牛奶。",position=2,expression=""},
	[2017060401] = {id=2017060401,storyid=20170604,pos=1,description="嗯~怎么所有人都需要我们帮忙做食物~？",position=2,expression=""},
	[2017070101] = {id=2017070101,storyid=20170701,pos=1,description="竟然敢找上门来，你们真是活腻了~",position=2,expression=""},
	[2017070201] = {id=2017070201,storyid=20170702,pos=1,description="厨师长！你到底有什么目的？为什么要制作这些毒药~",position=2,expression=""},
	[2017070301] = {id=2017070301,storyid=20170703,pos=1,description="你们马上就要死在这里了~我和要死的人没什么好说的~哈哈~",position=2,expression=""},
	[2017070401] = {id=2017070401,storyid=20170704,pos=1,description="小的们，给我多吃点魔化食物，干掉他们！",position=2,expression=""},
	[2017080101] = {id=2017080101,storyid=20170801,pos=1,description="我好像做了一个梦，在梦里我在制造魔化饥民……",position=2,expression=""},
	[2017080201] = {id=2017080201,storyid=20170802,pos=1,description="到底发生了什么？",position=2,expression=""},
	[2017080301] = {id=2017080301,storyid=20170803,pos=1,description="呜……是，是镇长！",position=2,expression=""},
	[2017080401] = {id=2017080401,storyid=20170804,pos=1,description="镇长在顶层的实验室里制作了很多绿色的毒物，我企图阻止他。然后被他喂了一颗绿色的果子就什么都不记得了。",position=2,expression=""},
	[2017080501] = {id=2017080501,storyid=20170805,pos=1,description="是我们的镇长做出这些事的！！？",position=2,expression=""},
	[2017080601] = {id=2017080601,storyid=20170806,pos=1,description="竟然把大家变成这样，我绝对饶不了他。",position=2,expression=""},
	[1017090001] = {id=1017090001,storyid=10170900,pos=1,description="在餐厅里终于找够家具了~",position=2,expression=""},
	[1017090002] = {id=1017090002,storyid=10170900,pos=2,description="是啊~咱们可以让餐厅更加豪华了，可以赚更多的钱了，哈哈…",position=1,expression=""},
	[1017100001] = {id=1017100001,storyid=10171000,pos=1,description="我们又救出了很多村民，但是他们好像都有些中毒。",position=2,expression=""},
	[1017100002] = {id=1017100002,storyid=10171000,pos=2,description="我们再来次营业，可以帮大家解毒还能赚钱。",position=1,expression=""},
	[1017100003] = {id=1017100003,storyid=10171000,pos=3,description="恩，可以！",position=2,expression=""},
	[1017110001] = {id=1017110001,storyid=10171100,pos=1,description="终于完成了，这样大家身上的毒都解除了。",position=2,expression=""},
	[1017110002] = {id=1017110002,storyid=10171100,pos=2,description="嘿嘿，又在赚了一笔。",position=1,expression=""},
	[1018010001] = {id=1018010001,storyid=10180100,pos=1,description="我们为了开张需要准备些什么呢~？",position=2,expression=""},
	[1018010002] = {id=1018010002,storyid=10180100,pos=2,description="你还是什么都不做比较好~~（呵呵，让你一直说我开船技术差~）",position=1,expression=""},
	[1018010003] = {id=1018010003,storyid=10180100,pos=3,description="你是不是还记恨我说你的船长证是买的？",position=2,expression=""},
	[1018010004] = {id=1018010004,storyid=10180100,pos=4,description="额~我没有啊……你怎么知道我的船长证是买……？（差点说漏嘴了~）",position=1,expression=""},
	[1018020001] = {id=1018020001,storyid=10180200,pos=1,description="喵~这些饥民似乎很喜欢吃小胖做的食物~",position=2,expression=""},
	[1018030001] = {id=1018030001,storyid=10180300,pos=1,description="这样饥民就不会去吃那些魔化食物了。",position=2,expression=""},
	[1018030002] = {id=1018030002,storyid=10180300,pos=2,description="嗯~我们暂时控制了魔化症状的蔓延~",position=1,expression=""},
	[1019010001] = {id=1019010001,storyid=10190100,pos=1,description="可还是得从根源上抓住魔化食物的主谋。",position=2,expression=""},
	[1019010002] = {id=1019010002,storyid=10190100,pos=2,description="嗯~谁也没想到这都是镇长做的~",position=1,expression=""},
	[1019010003] = {id=1019010003,storyid=10190100,pos=3,description="厨师长说镇长在顶层的实验室里，我们先去调查他的研究所吧。",position=2,expression=""},
	[1019010004] = {id=1019010004,storyid=10190100,pos=4,description="我们继续进发吧~",position=1,expression=""},
	[1019020001] = {id=1019020001,storyid=10190200,pos=1,description="研究所附近的饥民和海盗真烦~",position=2,expression=""},
	[1019020002] = {id=1019020002,storyid=10190200,pos=2,description="我们已经找到镇长的据点了，接下来继续探险~",position=1,expression=""},
	[2019030101] = {id=2019030101,storyid=20190301,pos=1,description="这些人怎么都被关在罐子里~要做猫罐头吗~？",position=2,expression=""},
	[2019030201] = {id=2019030201,storyid=20190302,pos=1,description="这里真可怕，这些人都被抓来关在实验舱里了。",position=2,expression=""},
	[2019030301] = {id=2019030301,storyid=20190303,pos=1,description="赶紧把他们救出来吧。",position=2,expression=""},
	[2019030401] = {id=2019030401,storyid=20190304,pos=1,description="空气里有一股消毒水的味道。",position=2,expression=""},
	[2019040101] = {id=2019040101,storyid=20190401,pos=1,description="额……人类，你们之前一直吃我们，现在我要吃你们~~",position=2,expression=""},
	[2019040201] = {id=2019040201,storyid=20190402,pos=1,description="感受农作物的愤怒吧~！",position=2,expression=""},
	[2019040301] = {id=2019040301,storyid=20190403,pos=1,description="啊~植物都变异了~我不要被植物吃啊~~",position=2,expression=""},
	[1019050001] = {id=1019050001,storyid=10190500,pos=1,description="我们该从哪进入实验室呢？外面没有进入的通道~",position=1,expression=""},
	[1019050002] = {id=1019050002,storyid=10190500,pos=2,description="还是应该去之前的那个山洞里找找。",position=2,expression=""},
	[2019060101] = {id=2019060101,storyid=20190601,pos=1,description="那个人在干嘛~？好可怕~",position=2,expression=""},
	[2019060201] = {id=2019060201,storyid=20190602,pos=1,description="得努力挖掘才行~",position=2,expression=""},
	[2019060301] = {id=2019060301,storyid=20190603,pos=1,description="嗯~老人家，请问你知道有很多玻璃罐子的屋子在哪里吗？（老人家一定不知道实验室是什么吧~）",position=2,expression=""},
	[2019060401] = {id=2019060401,storyid=20190604,pos=1,description="你说的是镇长的研究所吗？",position=2,expression=""},
	[2019060501] = {id=2019060501,storyid=20190605,pos=1,description="额……",position=2,expression=""},
	[2019060601] = {id=2019060601,storyid=20190606,pos=1,description="你们往上走，研究所的入口在外面。",position=2,expression=""},
	[2019070101] = {id=2019070101,storyid=20190701,pos=1,description="这里的罐子不是关人的，上面写了些东西~",position=2,expression=""},
	[2019070201] = {id=2019070201,storyid=20190702,pos=1,description="“大力丸”制作罐？看起来似乎能制作一些回复和增强的药剂~",position=2,expression=""},
	[2019070301] = {id=2019070301,storyid=20190703,pos=1,description="我们可以来试试。",position=2,expression=""},
	[2019080101] = {id=2019080101,storyid=20190801,pos=1,description="你们胆敢惊扰我~感受雷神的震怒吧~",position=2,expression=""},
	[2019080201] = {id=2019080201,storyid=20190802,pos=1,description="他是雷神吗？明明是个鸟人……",position=2,expression=""},
	[2019080301] = {id=2019080301,storyid=20190803,pos=1,description="你们说什么！！",position=2,expression=""},
	[2019080401] = {id=2019080401,storyid=20190804,pos=1,description="没什么~",position=2,expression=""},
	[2019080501] = {id=2019080501,storyid=20190805,pos=1,description="你们一定会被我轰成烤鸡~！",position=2,expression=""},
	[2019090101] = {id=2019090101,storyid=20190901,pos=1,description="你们几个终于找到这里了，竟敢破坏我的计划！",position=2,expression=""},
	[2019090201] = {id=2019090201,storyid=20190902,pos=1,description="今天就让你们有来无回，让我这些被改造的手下来会会你们~",position=2,expression=""},
	[2019090301] = {id=2019090301,storyid=20190903,pos=1,description="镇长，你清醒一点~",position=2,expression=""},
	[2019090401] = {id=2019090401,storyid=20190904,pos=1,description="镇长，你是不是因为叶小胖被抓走了所以受了刺激？",position=2,expression=""},
	[2019090501] = {id=2019090501,storyid=20190905,pos=1,description="……啊！？",position=2,expression=""},
	[2019090601] = {id=2019090601,storyid=20190906,pos=1,description="你们两个小东西还在这嘴碎，待会就把你们关进实验舱~",position=2,expression=""},
	[2019100101] = {id=2019100101,storyid=20191001,pos=1,description="我竟然输了，真是不服老不行啊！",position=2,expression=""},
	[2019100201] = {id=2019100201,storyid=20191002,pos=1,description="你为什么要制造那些魔化药剂？",position=2,expression=""},
	[2019100301] = {id=2019100301,storyid=20191003,pos=1,description="嘿嘿嘿，我为什么要制造~？",position=2,expression=""},
	[2019100401] = {id=2019100401,storyid=20191004,pos=1,description="这都是安达卡大神的意愿，你们所有人都要变成他的奴仆~！！",position=2,expression=""},
	[2019100501] = {id=2019100501,storyid=20191005,pos=1,description="安达卡大神！！？那个传说中曾经淹没大陆的邪神领主？",position=2,expression=""},
	[2019100601] = {id=2019100601,storyid=20191006,pos=1,description="我从海里打捞上了邪神的护符，安达卡大神给我下达了神谕。",position=2,expression=""},
	[2019100701] = {id=2019100701,storyid=20191007,pos=1,description="世界要被毁灭了！只有成为他的仆人才能免遭苦难，哈哈哈~！",position=2,expression=""},
	[2019100801] = {id=2019100801,storyid=20191008,pos=1,description="他疯了……",position=2,expression=""},
	[1019110001] = {id=1019110001,storyid=10191100,pos=1,description="看来这里的瘟疫这是镇长研究所搞的。",position=2,expression=""},
	[1019110002] = {id=1019110002,storyid=10191100,pos=2,description="对对~我们必须前往去破坏这个根源。",position=1,expression=""},
	[1019110003] = {id=1019110003,storyid=10191100,pos=3,description="那咱们出发吧~！",position=2,expression=""},
	[1019120001] = {id=1019120001,storyid=10191200,pos=1,description="魔化疫病终于被消灭了。",position=2,expression=""},
	[1019120002] = {id=1019120002,storyid=10191200,pos=2,description="嗯~饥民们只要不再吃有毒的食物就会慢慢恢复神智~",position=1,expression=""},
	[1019120003] = {id=1019120003,storyid=10191200,pos=3,description="镇长被关进了精神病院，他嘴里还一只不停地说着安达卡的事。",position=2,expression=""},
	[1019120004] = {id=1019120004,storyid=10191200,pos=4,description="呜~我听过这个名字，据说是遥远世界里的邪神~",position=1,expression=""},
	[1019120005] = {id=1019120005,storyid=10191200,pos=5,description="哦对了，那块护符~！！",position=1,expression=""},
	[1019120006] = {id=1019120006,storyid=10191200,pos=6,description="护符已经被我破坏了，那东西似乎有蛊惑人心的能力。",position=2,expression=""},
	[1020010001] = {id=1020010001,storyid=10200100,pos=1,description="我看到那块护符的制作工艺似乎来自玛雅城岛。",position=2,expression=""},
	[1020010002] = {id=1020010002,storyid=10200100,pos=2,description="嗯~我们应该去调查看看吗？~",position=1,expression=""},
	[1020010003] = {id=1020010003,storyid=10200100,pos=3,description="贝蒂斯吵着要回埃及，正好玛雅岛在回埃及岛的路上，我们可以顺路去调查看看",position=2,expression=""},
	[1020010004] = {id=1020010004,storyid=10200100,pos=4,description="埃及城啊~一定有很多金子~（嘿嘿，到时候找贝蒂斯的家人要一大笔车马费~送人回去可不能白送~）",position=1,expression=""},
	[1020010005] = {id=1020010005,storyid=10200100,pos=5,description="但是我们的船上次只是粗略修了一下，以现在的船体还到不了玛雅岛，我们需要更多的木料来升级船。",position=2,expression=""},
	[1020020001] = {id=1020020001,storyid=10200200,pos=1,description="你们是要去玛雅岛吗？我们也要一起去调查安达卡护符的事。",position=2,expression=""},
	[1020020002] = {id=1020020002,storyid=10200200,pos=2,description="可是我们木料不足了，去玛雅岛还得更多木料升级我们的船~",position=1,expression=""},
	[1020020003] = {id=1020020003,storyid=10200200,pos=3,description="木料？美食岛附近就有一个木材岛，专产木料的，我们可以去那里找木材。",position=2,expression=""},
	[1020020004] = {id=1020020004,storyid=10200200,pos=4,description="那还等什么呢~？赶紧出发吧~",position=1,expression=""},
	[2020030101] = {id=2020030101,storyid=20200301,pos=1,description="你们几个好大的胆子，还敢找上门~！",position=2,expression=""},
	[2020030201] = {id=2020030201,storyid=20200302,pos=1,description="老大，你先带着木材走吧~",position=2,expression=""},
	[2020030301] = {id=2020030301,storyid=20200303,pos=1,description="等我们解决完了这些老鼠就去跟你汇合~",position=2,expression=""},
	[2020030401] = {id=2020030401,storyid=20200304,pos=1,description="你们几个对付这些人也够了，我先战术性撤退~",position=2,expression=""},
	[2020030501] = {id=2020030501,storyid=20200305,pos=1,description="这些玛雅城的战士竟然做了强盗~",position=2,expression=""},
	[2020040101] = {id=2020040101,storyid=20200401,pos=1,description="呼~强盗在附近有两，两个粮仓，只要烧了就能逼他们去救，救火~",position=2,expression=""},
	[2020040201] = {id=2020040201,storyid=20200402,pos=1,description="那，那时头目旁边的守，守，守卫就会少人，你们就能直击头目了……",position=2,expression=""},
	[2020040301] = {id=2020040301,storyid=20200403,pos=1,description="守粮仓的强盗太，太多了，我先，先去引开一部分人，呼~",position=2,expression=""},
	[2020040401] = {id=2020040401,storyid=20200404,pos=1,description="嗯~那我们就兵分两路，来一个调虎离山~",position=2,expression=""},
	[1020050001] = {id=1020050001,storyid=10200500,pos=1,description="不光弄到了足够的木材还打了强盗一顿~哈哈~",position=1,expression=""},
	[1020050002] = {id=1020050002,storyid=10200500,pos=2,description="我们有足够的木材升级船只了。",position=2,expression=""},
	[1020050003] = {id=1020050003,storyid=10200500,pos=3,description="我们下次不顺心了就去伐木岛揍强盗出气吧~",position=1,expression=""},
	[1020050004] = {id=1020050004,storyid=10200500,pos=4,description="额……（暴力少女）",position=2,expression=""},
	[1021010001] = {id=1021010001,storyid=10210100,pos=1,description="材料足够了，咱们升级船长室吧。",position=2,expression=""},
	[1021010002] = {id=1021010002,storyid=10210100,pos=2,description="哈哈，升级船长室的事情就靠你了，李凡。",position=1,expression=""},
	[1021010003] = {id=1021010003,storyid=10210100,pos=3,description="没问题，包在我身上了。",position=2,expression=""},
	[1021020001] = {id=1021020001,storyid=10210200,pos=1,description="呼~升级完成了，这样我们可以航船更远的大海了。",position=2,expression=""},
	[1021020002] = {id=1021020002,storyid=10210200,pos=2,description="哈哈，太好了，我的梦想可以实现了，我要前往传说中的ONE PIECE 航路。",position=1,expression=""},
	[1021020003] = {id=1021020003,storyid=10210200,pos=3,description="不是我打击你，你连路都不认识~~",position=2,expression=""},
	[1022010001] = {id=1022010001,storyid=10220100,pos=1,description="诶，那是……骑士岛的镇民！",position=1,expression=""},
	[1022010002] = {id=1022010002,storyid=10220100,pos=2,description="你怎么到这儿来了？",position=1,expression=""},
	[1022010003] = {id=1022010003,storyid=10220100,pos=3,description="我还不容易才找到你们，大事不好了！",position=2,expression=""},
	[1022010004] = {id=1022010004,storyid=10220100,pos=4,description="岛上突然出现了无数的蜘蛛，好久村民被它们吃掉了。",position=2,expression=""},
	[1022010005] = {id=1022010005,storyid=10220100,pos=5,description="怎么会，难道是之前笔记本里说到的那些蜘蛛，看来在我们不知道的地方有蜘蛛巢穴。",position=1,expression=""},
	[1022020001] = {id=1022020001,storyid=10220200,pos=1,description="我们得赶紧回去救那些人。",position=2,expression=""},
	[1022020002] = {id=1022020002,storyid=10220200,pos=2,description="别等了~我刚打完伐木岛的强盗手还热乎呢~出发！",position=1,expression=""},
	[1022020003] = {id=1022020003,storyid=10220200,pos=3,description="果真暴力……",position=2,expression=""},
	[1022030001] = {id=1022030001,storyid=10220300,pos=1,description="这些蜘蛛太弱了，我还没使力它们就倒下了~",position=2,expression=""},
	[1022030002] = {id=1022030002,storyid=10220300,pos=2,description="还不是靠我的大火球~",position=1,expression=""},
	[1022030003] = {id=1022030003,storyid=10220300,pos=3,description="好了，好了，你牛，你牛，你的火球像气球(▼⊿▼)~",position=2,expression=""},
	[1022030004] = {id=1022030004,storyid=10220300,pos=4,description="你可不要羡慕我的魔法技术~嘿嘿~",position=1,expression=""},
	[1022030005] = {id=1022030005,storyid=10220300,pos=5,description="额……（她听不出我实在讽刺吗？真是乐天派~）",position=2,expression=""},
	[1032010001] = {id=1032010001,storyid=10320100,pos=1,description="虽然蜘蛛巢穴被我们干掉了，但还是有很多蜘蛛，我们必须清理掉这些蜘蛛，不然村民们还会有危险。",position=2,expression=""},
	[1032010002] = {id=1032010002,storyid=10320100,pos=2,description="恩，我也这么觉得，让小胖和李凡准备下，我们这次可是持久战。",position=1,expression=""},
	[1032020001] = {id=1032020001,storyid=10320200,pos=1,description="终于清理完成了，这样应该可以抵挡一阵子了。",position=2,expression=""},
	[1032020002] = {id=1032020002,storyid=10320200,pos=2,description="是啊，蜘蛛太多了，根本清理不完，这次也只是清理了一部份。",position=1,expression=""},
	[1032020003] = {id=1032020003,storyid=10320200,pos=3,description="没办法，这次大概能坚持一个月，一个月后我们再来清理一下。",position=2,expression=""},
	[1033010001] = {id=1033010001,storyid=10330100,pos=1,description="这里的事情应该也告一段路，我们还是前往埃及吧！",position=1,expression=""},
	[1033010002] = {id=1033010002,storyid=10330100,pos=2,description="恩，可以，贝蒂斯又在吵闹了，笨猫真是烦呢。",position=2,expression=""},
	[1033010003] = {id=1033010003,storyid=10330100,pos=3,description="嘿嘿~（大量的金币我来了~）",position=1,expression=""},
	[1033020001] = {id=1033020001,storyid=10330200,pos=1,description="可恶，我差点因为晕船而死了~",position=2,expression=""},
	[1033020002] = {id=1033020002,storyid=10330200,pos=2,description="呜嘿嘿~是你们太弱了，这么点浪就不行了。",position=1,expression=""},
	[1034010001] = {id=1034010001,storyid=10340100,pos=1,description="这里就是传说中的竞技岛了，岛上人还真是多。",position=2,expression=""},
	[1034010002] = {id=1034010002,storyid=10340100,pos=2,description="听说竞技岛上有竞技场，战斗胜利可以获得奖励。",position=1,expression=""},
	[1034010003] = {id=1034010003,storyid=10340100,pos=3,description="是的，被你这么一说我也有点手痒了，咱们去看看吧！",position=2,expression=""},
	[1034010004] = {id=1034010004,storyid=10340100,pos=4,description="好啊~奖励我来了。",position=1,expression=""},
	[1034020001] = {id=1034020001,storyid=10340200,pos=1,description="哎呀，差一点我们就可以获得第一名了。",position=2,expression=""},
	[1034020002] = {id=1034020002,storyid=10340200,pos=2,description="是啊，是啊，第一名的奖励可是非常丰富的。",position=1,expression=""},
	[1034020003] = {id=1034020003,storyid=10340200,pos=3,description="那次努力拿个第一，不过在拿第一前，我们得提升下自己的实力。",position=2,expression=""},
	[1034020004] = {id=1034020004,storyid=10340200,pos=4,description="那就努力提升实力，目标是第一。",position=1,expression=""},
	[1035010001] = {id=1035010001,storyid=10350100,pos=1,description="诶，那个好像是美食城的村民吧~",position=1,expression=""},
	[1035010002] = {id=1035010002,storyid=10350100,pos=2,description="好像是的，咱们过去看看。",position=2,expression=""},
	[1035020001] = {id=1035020001,storyid=10350200,pos=1,description="你不是美食岛的人吗？怎么跑这里来了？",position=1,expression=""},
	[1035020002] = {id=1035020002,storyid=10350200,pos=2,description="美食岛新种的粮食还没成熟，所以饥荒又爆发了~",position=2,expression="dengyan"},
	[1035020003] = {id=1035020003,storyid=10350200,pos=3,description="恩~~我貌似闻到了金币的味道",position=1,expression=""},
	[1035030001] = {id=1035030001,storyid=10350300,pos=1,description="我打听到美食城又爆发饥荒了。",position=1,expression=""},
	[1035030002] = {id=1035030002,storyid=10350300,pos=2,description="意料之内，我们船上有足够的食材，可以前往美食城营业。",position=2,expression=""},
	[1035030003] = {id=1035030003,storyid=10350300,pos=3,description="哈哈，本船长也是这么想的。",position=1,expression=""},
	[1035030004] = {id=1035030004,storyid=10350300,pos=4,description="嘿嘿~又可以大赚一笔了~",position=1,expression=""},
	[1035030005] = {id=1035030005,storyid=10350300,pos=5,description="……（财奴）",position=2,expression=""},
	[1035040001] = {id=1035040001,storyid=10350400,pos=1,description="喵~本喵累死了~",position=2,expression=""},
	[1035040002] = {id=1035040002,storyid=10350400,pos=2,description="竟然让本猫神做这种粗活~",position=2,expression=""},
	[1035040003] = {id=1035040003,storyid=10350400,pos=3,description="哈哈~努力工作才有小鱼干吃哦~",position=1,expression=""},
	[1035040004] = {id=1035040004,storyid=10350400,pos=4,description="喵~我要小鱼干~",position=2,expression=""},
	[1035040005] = {id=1035040005,storyid=10350400,pos=5,description="嘿嘿，又大赚了一笔。",position=1,expression=""},
	[1035050101] = {id=1035050101,storyid=10350501,pos=1,description="既然我们大赚……啊呸，解决了美食岛食物的危机，我们赶紧去埃及吧，我要去寻找宝藏~",position=1,expression=""},
	[1035050301] = {id=1035050301,storyid=10350503,pos=1,description="",position=1,expression=""},
	[1035050401] = {id=1035050401,storyid=10350504,pos=1,description="说到去埃及，不过我们得先去玛雅岛呢。",position=1,expression=""},
	[1035050501] = {id=1035050501,storyid=10350505,pos=1,description="不，本喵要去埃及，你们都拐卖本喵干了好多杂务啦！",position=2,expression=""},
	[1035050601] = {id=1035050601,storyid=10350506,pos=1,description="",position=2,expression=""},
	[1035050701] = {id=1035050701,storyid=10350507,pos=1,description="玛雅在海图上的坐标可是去埃及必经之地哦，那里或许有你重要的使命。",position=1,expression=""},
	[1035050801] = {id=1035050801,storyid=10350508,pos=1,description="而且去玛雅，姐姐会给你吃不完的小鱼干哦！",position=2,expression=""},
	[1035050901] = {id=1035050901,storyid=10350509,pos=1,description="（重要的使命？）",position=1,expression=""},
	[1035051001] = {id=1035051001,storyid=10350510,pos=1,description="",position=1,expression=""},
	[1035051101] = {id=1035051101,storyid=10350511,pos=1,description="你们是不是要去寻找玛雅的宝藏？带我一个带我一个！",position=2,expression=""},
	[1035051201] = {id=1035051201,storyid=10350512,pos=1,description="虽然我是船长，但是我不会独吞啦~",position=1,expression=""},
	[1035051301] = {id=1035051301,storyid=10350513,pos=1,description="",position=1,expression=""},
	[1035051401] = {id=1035051401,storyid=10350514,pos=1,description="你个财奴，就知道宝藏，如果你能满足我几个条件，我就带你去哦！",position=2,expression=""},
	[1035051501] = {id=1035051501,storyid=10350515,pos=1,description="喵~我们我们是去找宝藏的嘛~哎？？",position=2,expression=""},
	[1035051601] = {id=1035051601,storyid=10350516,pos=1,description="算了，有小鱼干就可以了，我要去玛雅，我要吃好多小鱼干，喵~呜~！ ",position=2,expression=""},
	[1035051701] = {id=1035051701,storyid=10350517,pos=1,description="可爱（好骗）的贝斯蒂~来给姐姐抱抱",position=1,expression=""},
	[1035051801] = {id=1035051801,storyid=10350518,pos=1,description="小鱼干哪有包子好吃？",position=1,expression=""},
	[1035051901] = {id=1035051901,storyid=10350519,pos=1,description="那么就这样定了，宝藏我来了，目标玛雅~",position=2,expression=""},
	[1036000001] = {id=1036000001,storyid=10360000,pos=1,description="我们出发去玛雅吧~以后也要互相帮助哦~",position=1,expression=""},
	[1036010001] = {id=1036010001,storyid=10360100,pos=1,description="互相帮助是应该的",position=2,expression=""},
	[1036020001] = {id=1036020001,storyid=10360200,pos=1,description="我给你们做大肉包~",position=2,expression=""},
	[1036030001] = {id=1036030001,storyid=10360300,pos=1,description="喵~喵~喵~我要小鱼干!",position=2,expression=""},
	[1036030002] = {id=1036030002,storyid=10360300,pos=2,description="",position=2,expression="weixiao"},
	[1036040001] = {id=1036040001,storyid=10360400,pos=1,description="船长~虽然你老是开船撞岛~开船进入大漩涡~又那么的贪财~",position=2,expression=""},
	[1036040002] = {id=1036040002,storyid=10360400,pos=2,description="但你很适合当船长哦~",position=2,expression=""},
	[1036040003] = {id=1036040003,storyid=10360400,pos=3,description="",position=2,expression="keai"},
	[1036040004] = {id=1036040004,storyid=10360400,pos=4,description="……嗯？嗯？嗯？",position=1,expression=""},
	[1036050001] = {id=1036050001,storyid=10360500,pos=1,description="哇！虽历经千辛万苦，终于来到了玛雅岛",position=1,expression=""},
	[1036050002] = {id=1036050002,storyid=10360500,pos=2,description="看来我对船的掌握程度又提升了呢！嘿~嘿~",position=1,expression=""},
	[1036050003] = {id=1036050003,storyid=10360500,pos=3,description="呕~~可别说了，幸好我们提前将船体做了加固与修理，不然肯定要葬身海底",position=2,expression=""},
	[1036050004] = {id=1036050004,storyid=10360500,pos=4,description="也不知道谁又让船撞了5次浅滩，误入6次海啸以及……",position=2,expression=""},
	[1036060001] = {id=1036060001,storyid=10360600,pos=1,description="",position=2,expression="xuanyun"},
	[1036060002] = {id=1036060002,storyid=10360600,pos=2,description="别说啦~本喵要吃晕船药",position=2,expression=""},
	[1036060003] = {id=1036060003,storyid=10360600,pos=3,description="",position=2,expression="QAQ"},
	[1036070001] = {id=1036070001,storyid=10360700,pos=1,description="停~停~停~最终不还是到了吗？本船长不看过程！只看结果！",position=1,expression=""},
	[1036070002] = {id=1036070002,storyid=10360700,pos=2,description="所以我还是出色的船长！！！",position=1,expression=""},
	[1036070003] = {id=1036070003,storyid=10360700,pos=3,description="行行行~我的大船长，我们的物资和食物都要用光啦！",position=2,expression=""},
	[1036070004] = {id=1036070004,storyid=10360700,pos=4,description="我们穷到吃不起饭啦！大船长！",position=2,expression=""},
	[1036070005] = {id=1036070005,storyid=10360700,pos=5,description="哼，就知道哭穷。本船长从来不会亏待你们",position=1,expression=""},
	[1036070006] = {id=1036070006,storyid=10360700,pos=6,description="走！我们去看看这座岛能有啥新鲜有用的资源",position=1,expression=""},
	[1036070007] = {id=1036070007,storyid=10360700,pos=7,description="",position=1,expression="lingguang"},
	[1037000001] = {id=1037000001,storyid=10370000,pos=1,description="走吧，我们赶紧在玛雅岛进行调查吧~",position=1,expression=""},
	[1037000002] = {id=1037000002,storyid=10370000,pos=2,description="嘿~嘿~顺便看看有没有宝藏和好吃的~",position=1,expression=""},
	[1037000003] = {id=1037000003,storyid=10370000,pos=3,description="额~后面的才是你真正的目的吧？",position=2,expression=""},
	[1037000004] = {id=1037000004,storyid=10370000,pos=4,description="",position=2,expression="wuyu"},
	[1037010001] = {id=1037010001,storyid=10370100,pos=1,description="这次玛雅之行想必非常危险，你一定要小心点~",position=2,expression=""},
	[1037010002] = {id=1037010002,storyid=10370100,pos=2,description="",position=2,expression="yuse"},
	[1037010003] = {id=1037010003,storyid=10370100,pos=3,description="本船长才不怕什么安达卡邪神呢！哼~",position=1,expression=""},
	[1037010004] = {id=1037010004,storyid=10370100,pos=4,description="但愿如此吧……",position=2,expression=""},
	[1037020001] = {id=1037020001,storyid=10370200,pos=1,description="奥薇莉克斯，我们来到这座岛明明什么坏事都没做",position=1,expression=""},
	[1037020002] = {id=1037020002,storyid=10370200,pos=2,description="为什么玛雅的士兵会无缘无故的袭击我们",position=1,expression=""},
	[1037020003] = {id=1037020003,storyid=10370200,pos=3,description="对此我们是一头雾水，你知道是什么情况吗？",position=1,expression=""},
	[1037020004] = {id=1037020004,storyid=10370200,pos=4,description="玛雅岛本来是一个欣欣向荣又富有资源的岛屿",position=2,expression=""},
	[1037020005] = {id=1037020005,storyid=10370200,pos=5,description="外界人曾经把它称作为“桃源之岛”",position=2,expression=""},
	[1037020006] = {id=1037020006,storyid=10370200,pos=6,description="岛里的大祭司库库尔坎是由族人们选举产生的，主持着各种岛内事务",position=2,expression=""},
	[1037020007] = {id=1037020007,storyid=10370200,pos=7,description="她从很久前开始就深受族人们的爱戴",position=2,expression=""},
	[1037020008] = {id=1037020008,storyid=10370200,pos=8,description="可是前段时间考古学家们在玛雅金字塔发现了远古石碑，",position=2,expression=""},
	[1037020009] = {id=1037020009,storyid=10370200,pos=9,description="引发了一段时间的考古浪潮",position=2,expression=""},
	[1037020010] = {id=1037020010,storyid=10370200,pos=10,description="但石碑有蛊惑人心的力量，周围的考古小队都被石碑给腐化变得嗜血",position=2,expression=""},
	[1037020011] = {id=1037020011,storyid=10370200,pos=11,description="库库尔坎试图去调查并净化石碑，相传石碑被她破坏了",position=2,expression=""},
	[1037020012] = {id=1037020012,storyid=10370200,pos=12,description="但后来她就性情大变，相应地嗜血起来，听不进去任何人的话语",position=2,expression=""},
	[1037020013] = {id=1037020013,storyid=10370200,pos=13,description="我们认为石碑并没有被破坏，就是它影响着库库尔坎",position=2,expression=""},
	[1037020014] = {id=1037020014,storyid=10370200,pos=14,description="大概攻击你的士兵也只是听从她的命令吧",position=2,expression=""},
	[1037020015] = {id=1037020015,storyid=10370200,pos=15,description="石碑？我大概知道是什么回事了。奥薇莉克斯，我们来一起拯救玛雅吧！",position=1,expression=""},
	[1037020016] = {id=1037020016,storyid=10370200,pos=16,description="但是你得给我开个好价钱，虽然我想当英雄，但是有钱就更好啦~",position=1,expression=""},
	[1037020017] = {id=1037020017,storyid=10370200,pos=17,description="如果能够拯救玛雅，我们那个村子里的黄金都归你了！",position=2,expression=""},
	[1037020018] = {id=1037020018,storyid=10370200,pos=18,description="原来是她",position=2,expression=""},
	[1037020019] = {id=1037020019,storyid=10370200,pos=19,description="如果能够拯救玛雅，我们那个村子里的黄金都归你了！",position=2,expression=""},
	[1037030001] = {id=1037030001,storyid=10370300,pos=1,description="船长，库库尔坎以前与我有过一面之缘，虽然她的缺点不计其数",position=2,expression=""},
	[1037030002] = {id=1037030002,storyid=10370300,pos=2,description="但我相信她不会是这样的祭司，她一定是被某种力量给操控了！",position=2,expression=""},
	[1037040001] = {id=1037040001,storyid=10370400,pos=1,description="你认识库库尔坎？",position=2,expression=""},
	[1037050001] = {id=1037050001,storyid=10370500,pos=1,description="嗯，有过不小的矛盾。",position=2,expression=""},
	[1037060001] = {id=1037060001,storyid=10370600,pos=1,description="本喵也认识哦~她还是个美女~人也挺……",position=2,expression=""},
	[1037060002] = {id=1037060002,storyid=10370600,pos=2,description="",position=2,expression="haipa"},
	[1037060003] = {id=1037060003,storyid=10370600,pos=3,description="（伊维尔神情不太对）",position=2,expression=""},
	[1037070001] = {id=1037070001,storyid=10370700,pos=1,description="继续说呀~贝蒂斯~",position=2,expression=""},
	[1037070002] = {id=1037070002,storyid=10370700,pos=2,description="",position=2,expression="weixiao"},
	[1037080001] = {id=1037080001,storyid=10370800,pos=1,description="喵呜~",position=2,expression=""},
	[1037080002] = {id=1037080002,storyid=10370800,pos=2,description="",position=2,expression="QAQ"},
	[1037090001] = {id=1037090001,storyid=10370900,pos=1,description="那我们赶紧行动吧！我要她恢复过来让后交出这座岛的宝藏！！！！",position=1,expression=""},
	[1037090002] = {id=1037090002,storyid=10370900,pos=2,description="",position=1,expression="xingfen"},
	[1037090003] = {id=1037090003,storyid=10370900,pos=3,description="就知道宝藏！你个财迷~",position=2,expression=""},
	[1037090004] = {id=1037090004,storyid=10370900,pos=4,description="",position=2,expression="shengqi"},
	[1038000001] = {id=1038000001,storyid=10380000,pos=1,description="感觉玛雅的形势异常的严峻，事不宜迟，赶紧接下来的探索吧！",position=1,expression=""},
	[1038000002] = {id=1038000002,storyid=10380000,pos=2,description="希望上天给我好运气~",position=1,expression=""},
	[1038000003] = {id=1038000003,storyid=10380000,pos=3,description="有句话怎么说来着？傻人有傻~ ",position=2,expression=""},
