	[1038000005] = {id=1038000005,storyid=10380000,pos=5,description="我要打死你！",position=1,expression=""},
	[1038000006] = {id=1038000006,storyid=10380000,pos=6,description="",position=1,expression="shengqi"},
	[1038000007] = {id=1038000007,storyid=10380000,pos=7,description="说错啦说错啦，是好人有好报！",position=2,expression=""},
	[1038000008] = {id=1038000008,storyid=10380000,pos=8,description="这还差不多。",position=1,expression=""},
	[1038010001] = {id=1038010001,storyid=10380100,pos=1,description="我会保护你们的，站在我身后就行",position=2,expression=""},
	[1038020001] = {id=1038020001,storyid=10380200,pos=1,description="难怪玛雅这个地方这么富饶，有这么多的元素精华滋润着这块大陆。",position=2,expression=""},
	[1038020002] = {id=1038020002,storyid=10380200,pos=2,description="不富饶才奇怪了。",position=2,expression=""},
	[1038020003] = {id=1038020003,storyid=10380200,pos=3,description="方才女巫提到的元素宝石是这块土地的通行证",position=1,expression=""},
	[1038020004] = {id=1038020004,storyid=10380200,pos=4,description="我们在冒险期间应该要多多留意这种道具，或许能够派上用场！",position=1,expression=""},
	[1038020005] = {id=1038020005,storyid=10380200,pos=5,description="咦？船长智商上线啦？",position=2,expression=""},
	[1038020006] = {id=1038020006,storyid=10380200,pos=6,description="",position=2,expression="jingtan"},
	[1038020007] = {id=1038020007,storyid=10380200,pos=7,description="伊~！维~！尔~！你一直认为我智商很低是吗？",position=1,expression=""},
	[1038030001] = {id=1038030001,storyid=10380300,pos=1,description="好啦好啦，我们出发吧！",position=2,expression=""},
	[1038040001] = {id=1038040001,storyid=10380400,pos=1,description="没想到集齐足够的元素宝石能召唤元素之灵",position=1,expression=""},
	[1038040002] = {id=1038040002,storyid=10380400,pos=2,description="各个元素之灵还拥有自己的精华",position=1,expression=""},
	[1038040003] = {id=1038040003,storyid=10380400,pos=3,description="将其打败后能获得相应的元素之心",position=1,expression=""},
	[1038040004] = {id=1038040004,storyid=10380400,pos=4,description="玛雅真是一个神奇的岛屿呀！",position=1,expression=""},
	[1038050001] = {id=1038050001,storyid=10380500,pos=1,description="是呀，当时突然出现元素之灵可把我给吓了一跳",position=2,expression=""},
	[1038060001] = {id=1038060001,storyid=10380600,pos=1,description="本喵才没被吓到~埃及有很多古怪的事情哦~",position=2,expression=""},
	[1038070001] = {id=1038070001,storyid=10380700,pos=1,description="这大千世界奇幻的事有很多，现在我们遇到的只是冰山一角",position=2,expression=""},
	[1038070002] = {id=1038070002,storyid=10380700,pos=2,description="遇到更多新鲜新奇的人和事，这才是冒险的意义",position=2,expression=""},
	[1038070003] = {id=1038070003,storyid=10380700,pos=3,description="准备好新的冒险了吗？船长？",position=2,expression=""},
	[1038070004] = {id=1038070004,storyid=10380700,pos=4,description="I am ready.my dear Ivear~",position=1,expression=""},
	[1038070005] = {id=1038070005,storyid=10380700,pos=5,description="",position=1,expression="keai"},
	[1038070006] = {id=1038070006,storyid=10380700,pos=6,description="emmm……恶心心~",position=2,expression=""},
	[1038070007] = {id=1038070007,storyid=10380700,pos=7,description="",position=2,expression="wuyu"},
	[1039000001] = {id=1039000001,storyid=10390000,pos=1,description="不知道有没有办法将元素之心转换为钱财？嘿~嘿~",position=1,expression=""},
	[1039000002] = {id=1039000002,storyid=10390000,pos=2,description="………我不知道（知道也不告诉你）",position=2,expression=""},
	[1039010001] = {id=1039010001,storyid=10390100,pos=1,description="曾经文明和谐的玛雅，怎么会沦落到这种地步",position=2,expression=""},
	[1039010002] = {id=1039010002,storyid=10390100,pos=2,description="血祭这样野蛮，残忍的行径都能在这片大地蔓延",position=2,expression=""},
	[1039010003] = {id=1039010003,storyid=10390100,pos=3,description="可见在背后操作这岛屿的无形之手所拥有的力量该是何等强大。",position=2,expression=""},
	[1039020001] = {id=1039020001,storyid=10390200,pos=1,description="我有点害怕",position=2,expression=""},
	[1039020002] = {id=1039020002,storyid=10390200,pos=2,description="",position=2,expression="haipa"},
	[1039030001] = {id=1039030001,storyid=10390300,pos=1,description="不能让这样的事情在我们眼前发生！",position=2,expression=""},
	[1039040001] = {id=1039040001,storyid=10390400,pos=1,description="我不管他拥有多大的力量，他遇到了本船长算是他倒霉",position=1,expression=""},
	[1039040002] = {id=1039040002,storyid=10390400,pos=2,description="船长……是的……我们应该坚定信心，出发吧！",position=2,expression=""},
	[1039040003] = {id=1039040003,storyid=10390400,pos=3,description="不要担心啦~伊维尔",position=1,expression=""},
	[1040000001] = {id=1040000001,storyid=10400000,pos=1,description="虽说我们救了很多的难民，但是我们目前没有足够的食物",position=1,expression=""},
	[1040000002] = {id=1040000002,storyid=10400000,pos=2,description="别着急，我打听到在玛雅附近有一个狩猎岛，上面可以收集到各种食物",position=2,expression=""},
	[1040000003] = {id=1040000003,storyid=10400000,pos=3,description="我们可以去看看，至于打猎，我对打猎并不喜欢~",position=2,expression=""},
	[1040000004] = {id=1040000004,storyid=10400000,pos=4,description="我们可以去拜访奥薇莉克斯",position=1,expression=""},
	[1040000005] = {id=1040000005,storyid=10400000,pos=5,description="那么船长，我们赶紧出发吧，安置难民得用一段时间，现在时间很宝贵",position=2,expression=""},
	[1040000006] = {id=1040000006,storyid=10400000,pos=6,description="好的",position=1,expression=""},
	[1040020001] = {id=1040020001,storyid=10400200,pos=1,description="打猎还真是有意思呢",position=1,expression=""},
	[1040020002] = {id=1040020002,storyid=10400200,pos=2,description="还是魔法比较有意思，要是能用魔法打猎就好了~",position=2,expression=""},
	[1041010001] = {id=1041010001,storyid=10410100,pos=1,description="现在有了足够的食物了，难民们也不用挨饿了",position=1,expression=""},
	[1041010002] = {id=1041010002,storyid=10410100,pos=2,description="那我们赶紧进行烹饪吧",position=2,expression=""},
	[1041020001] = {id=1041020001,storyid=10410200,pos=1,description="我们将食物发放给玛雅居民吧",position=2,expression=""},
	[1041020002] = {id=1041020002,storyid=10410200,pos=2,description="好的",position=1,expression=""},
	[1042000001] = {id=1042000001,storyid=10420000,pos=1,description="现在难民都安置好了，我们继续探险吧",position=2,expression=""},
	[1042010001] = {id=1042010001,storyid=10420100,pos=1,description="没想到，这次玛雅之旅是这样的曲折",position=1,expression=""},
	[1042010002] = {id=1042010002,storyid=10420100,pos=2,description="我们竟然拯救了如此多无辜之人的生命，我可真是天使下凡！",position=1,expression=""},
	[1042010003] = {id=1042010003,storyid=10420100,pos=3,description="",position=1,expression="xingfen"},
	[1042010004] = {id=1042010004,storyid=10420100,pos=4,description="是的，船长小天使！",position=2,expression=""},
	[1042010005] = {id=1042010005,storyid=10420100,pos=5,description="",position=2,expression="weixiao"},
	[1042010006] = {id=1042010006,storyid=10420100,pos=6,description="伊维尔居然不毒舌啦~",position=1,expression=""},
	[1042010007] = {id=1042010007,storyid=10420100,pos=7,description="毒舌也要分场合~",position=2,expression=""},
	[1043000001] = {id=1043000001,storyid=10430000,pos=1,description="感谢你救了，不然我们可能就要成为活祭品了！",position=1,expression=""},
	[1043000002] = {id=1043000002,storyid=10430000,pos=2,description="库库尔坎正在在被古籍中提到的远古邪神所蛊惑",position=2,expression=""},
	[1043000003] = {id=1043000003,storyid=10430000,pos=3,description="目前已将自己变为了邪神力量的枢纽，我们已经不可能正面打败她了。",position=2,expression=""},
	[1043000004] = {id=1043000004,storyid=10430000,pos=4,description="照这样说的话，玛雅岛不是已经完蛋呢？",position=1,expression=""},
	[1043000005] = {id=1043000005,storyid=10430000,pos=5,description="有一个冒险的做法，不知道你们想不想知道？",position=2,expression=""},
	[1043000006] = {id=1043000006,storyid=10430000,pos=6,description="说说看看",position=1,expression=""},
	[1043000007] = {id=1043000007,storyid=10430000,pos=7,description="",position=1,expression="jing"},
	[1043000008] = {id=1043000008,storyid=10430000,pos=8,description="邪神虽然强大无比，但是古籍中有记载几次他失败的战斗，其中一次是被月神在月圆之日给打败过",position=2,expression=""},
	[1043000009] = {id=1043000009,storyid=10430000,pos=9,description="所以我认为在月圆之夜，邪神的力量会骤减，或许是被月神所压制！",position=2,expression=""},
	[1043000010] = {id=1043000010,storyid=10430000,pos=10,description="你是说我们要在月圆之夜，再一次挑战库库尔坎？",position=1,expression=""},
	[1043000011] = {id=1043000011,storyid=10430000,pos=11,description="值得冒险，所以在此之前我们要加紧修炼。",position=2,expression=""},
	[1043000012] = {id=1043000012,storyid=10430000,pos=12,description="奥薇莉克斯你认为呢？",position=1,expression=""},
	[1043000013] = {id=1043000013,storyid=10430000,pos=13,description="玛雅先天性的有着诸多元素之力，我相信元素们也不愿意成为邪神的奴隶",position=2,expression=""},
	[1043000014] = {id=1043000014,storyid=10430000,pos=14,description="红叶一族的长老们在元素之地留下了众多的手札和古籍，那里有掌握图腾力量的要领",position=2,expression=""},
	[1043000015] = {id=1043000015,storyid=10430000,pos=15,description="我想我们应该在月圆之夜前，去往元素之地修炼，这样应该可以事半功倍。",position=2,expression=""},
	[1043000016] = {id=1043000016,storyid=10430000,pos=16,description="对，如果邪神正在积攒力量，我们就应该与玛雅本地的神灵们遗留的力量进行沟通，获得帮助",position=1,expression=""},
	[1043000017] = {id=1043000017,storyid=10430000,pos=17,description="这样我们能提高战胜邪神的机会！那我们赶紧出发吧！",position=1,expression=""},
	[1043000018] = {id=1043000018,storyid=10430000,pos=18,description="这样吧，你们去往元素之地，我去玛雅森林深处，找到古籍中提到的森林半神，看能不能提供帮助！",position=2,expression=""},
	[1043000019] = {id=1043000019,storyid=10430000,pos=19,description="还有半神吗？那好吧，我们分开行动。",position=1,expression=""},
	[1043000020] = {id=1043000020,storyid=10430000,pos=20,description="（半神是玛雅岛古老的秘密，就连玛雅的当地人知道也并不多，这个人很不简单，事情过后，我得查查他的背景）",position=3,expression=""},
	[1043000021] = {id=1043000021,storyid=10430000,pos=21,description="（………是我的幻觉吗？一股不祥的味道，这个罗修到底是盟友还是敌人？）",position=4,expression=""},
	[1043010001] = {id=1043010001,storyid=10430100,pos=1,description="船长……恩，没什么",position=2,expression=""},
	[1043010002] = {id=1043010002,storyid=10430100,pos=2,description="怎么啦~伊维尔，你身体不舒服吗？",position=1,expression=""},
	[1043010003] = {id=1043010003,storyid=10430100,pos=3,description="没什么，没……只是感觉有一股不祥的预感",position=2,expression=""},
	[1044000001] = {id=1044000001,storyid=10440000,pos=1,description="希望元素们能够给予我们帮助",position=2,expression=""},
	[1044010001] = {id=1044010001,storyid=10440100,pos=1,description="我们已经得到了图腾的祝福啦~我感觉我体内的能量在汹涌着~",position=1,expression=""},
	[1044010002] = {id=1044010002,storyid=10440100,pos=2,description="你还是把力量用到该用的地方吧！",position=2,expression=""},
	[1044020001] = {id=1044020001,storyid=10440200,pos=1,description="告诉你们一个好消息，我成功说服了半神们帮助我们，半神们答应赐予你们力量",position=2,expression=""},
	[1044020002] = {id=1044020002,storyid=10440200,pos=2,description="但是你们得通过半神们的考验，事不宜迟，我们赶紧出发吧！",position=2,expression=""},
	[1044020003] = {id=1044020003,storyid=10440200,pos=3,description="还得通过考验？哼！可真是有架子呢！我一定要通过考验让他们认可我！",position=1,expression=""},
	[1045000001] = {id=1045000001,storyid=10450000,pos=1,description="船长一定会通过半神的考验的！告诉你一个秘密哦，不只是半神，真神都在关注着你呢！",position=2,expression=""},
	[1044000002] = {id=1044000002,storyid=10440000,pos=2,description="真的吗！真的咩！哼哼，本船长可是天选之人呢！",position=1,expression=""},
	[1044000003] = {id=1044000003,storyid=10440000,pos=3,description="……或许吧……",position=2,expression=""},
	[1045000004] = {id=1045000004,storyid=10450000,pos=4,description="我迫不及待去见见半神了",position=1,expression=""},
	[1045020001] = {id=1045020001,storyid=10450200,pos=1,description="既图腾之力后，我们又废了好大力气获得半神的力量",position=1,expression=""},
	[1045020002] = {id=1045020002,storyid=10450200,pos=2,description="强者真的是挺辛苦呢~",position=1,expression=""},
	[1045020003] = {id=1045020003,storyid=10450200,pos=3,description="",position=1,expression="daxiao"},
	[1045020004] = {id=1045020004,storyid=10450200,pos=4,description="哈？你这就成为强者了？",position=2,expression=""},
	[1045020005] = {id=1045020005,storyid=10450200,pos=5,description="这要是在埃及，会把诸神们给笑岔气的~",position=2,expression=""},
	[1045020006] = {id=1045020006,storyid=10450200,pos=6,description="",position=2,expression="xiaoemo"},
	[1045020007] = {id=1045020007,storyid=10450200,pos=7,description="",position=1,expression="shengqi"},
	[1045030001] = {id=1045030001,storyid=10450300,pos=1,description="终于等到这个特殊的日子了，我们一定要把邪神给痛扁一顿！",position=1,expression=""},
	[1045030002] = {id=1045030002,storyid=10450300,pos=2,description="船长，虽然这个势头是很好啦~但是得小心点哦，这次战斗可能非同小可呢！",position=2,expression=""},
	[1045030003] = {id=1045030003,storyid=10450300,pos=3,description="咦……伊维尔？我可以认为你这是在担心我吗！",position=1,expression=""},
	[1045030004] = {id=1045030004,storyid=10450300,pos=4,description="额，我没有……我不是……嗯……好啦，赶紧出发吧！",position=2,expression=""},
	[1045030005] = {id=1045030005,storyid=10450300,pos=5,description="这次任务我们最好做两重打算，正面和计谋都要实施。",position=3,expression=""},
	[1045030006] = {id=1045030006,storyid=10450300,pos=6,description="正面由你们对战库库尔坎，我去搜索搜索有没有什么其他方法能够封印邪神，不入虎穴，焉得虎子？",position=3,expression=""},
	[1045030007] = {id=1045030007,storyid=10450300,pos=7,description="那好吧，我们分两头行动",position=1,expression=""},
	[1045030008] = {id=1045030008,storyid=10450300,pos=8,description="………………好吧（船长太容易相信他人啦）",position=2,expression=""},
	[1045030009] = {id=1045030009,storyid=10450300,pos=9,description="嗯？伊维尔，走啦~",position=1,expression=""},
	[1045030010] = {id=1045030010,storyid=10450300,pos=10,description="恩……我来了",position=2,expression=""},
	[1045040001] = {id=1045040001,storyid=10450400,pos=1,description="真该死！那个罗修竟然背叛了我们！",position=1,expression=""},
	[1045040002] = {id=1045040002,storyid=10450400,pos=2,description="",position=1,expression="shengqi"},
	[1045040003] = {id=1045040003,storyid=10450400,pos=3,description="虽说他背叛了我们，但是船长，你也应该反省反省自己。",position=2,expression=""},
	[1045040004] = {id=1045040004,storyid=10450400,pos=4,description="恩，我也不能再被其他人随意蒙骗了！",position=1,expression=""},
	[1045040005] = {id=1045040005,storyid=10450400,pos=5,description="虽然是被控制，但是我的确是做了很多伤天害理的事情",position=3,expression=""},
	[1045040006] = {id=1045040006,storyid=10450400,pos=6,description="我将用此生进行赎罪，关于那个罗修，我最后用洞察之力窥见他心中有一团无尽的黑暗，我们必须尽快找到他，",position=3,expression=""},
	[1045040007] = {id=1045040007,storyid=10450400,pos=7,description="你们去寻找玛雅最厉害的占卜师吧，就在元素之地，她能占卜一个人的命运，应该能帮助我们找到兽王罗修。",position=3,expression=""},
	[1045040008] = {id=1045040008,storyid=10450400,pos=8,description="库库尔坎，你快点休息，接下来的事情就交付给本船长了！",position=1,expression=""},
	[1045040009] = {id=1045040009,storyid=10450400,pos=9,description="库库尔坎，虽然很想跟你坐下来叙叙旧，但是时间紧急，我们就先出发了，不打扰你这个高贵的祭司养伤了，嘿~嘿~嘿~",position=2,expression=""},
	[1045040010] = {id=1045040010,storyid=10450400,pos=10,description="伊维尔，你还是如此的优秀，真是让人嫉妒！但是~~~",position=3,expression=""},
	[1045040011] = {id=1045040011,storyid=10450400,pos=11,description="但是身材却没有长进呢！！！！",position=3,expression=""},
	[1045040012] = {id=1045040012,storyid=10450400,pos=12,description="哼，肤浅！难怪会被一个傻子给控制。",position=2,expression=""},
	[1045040013] = {id=1045040013,storyid=10450400,pos=13,description="走啦走啦，有话以后在说。（这两人，似乎有矛盾？）",position=1,expression=""},
	[1045050001] = {id=1045050001,storyid=10450500,pos=1,description="我现在怀疑罗修从一开始就是事件的主谋……",position=2,expression=""},
	[1045050002] = {id=1045050002,storyid=10450500,pos=2,description="他知道我们来到了这个岛屿，然后借助我们的力量达到他的目的",position=2,expression=""},
	[1045050003] = {id=1045050003,storyid=10450500,pos=3,description="不会吧……他隐藏的可真够深的",position=1,expression=""},
	[1046010001] = {id=1046010001,storyid=10460100,pos=1,description="我们一定不能让罗修的阴谋得逞",position=2,expression=""},
	[1046020001] = {id=1046020001,storyid=10460200,pos=1,description="原来兽王罗修去了半神之地……不好半神们有危险！ ",position=1,expression=""},
	[1046020002] = {id=1046020002,storyid=10460200,pos=2,description="不好！我感觉有大事要发生，我们得赶紧出发……每一秒钟很宝贵",position=2,expression=""},
	[1046030001] = {id=1046030001,storyid=10460300,pos=1,description="一定要帮助半神们……这对于我有特殊的意义",position=2,expression=""},
	[1047010001] = {id=1047010001,storyid=10470100,pos=1,description="那我们赶紧出发去半身之地吧",position=2,expression=""},
	[1047020001] = {id=1047020001,storyid=10470200,pos=1,description="真是糟糕，玛雅岛的半神们居然也能被剥夺自身的意志",position=2,expression=""},
	[1047020002] = {id=1047020002,storyid=10470200,pos=2,description="这个世界缺少了玛雅的半神们，对抗邪神的胜算将会大大降低。",position=1,expression=""},
	[1047020003] = {id=1047020003,storyid=10470200,pos=3,description="伊维尔？真的有你说的那么严重吗？",position=2,expression=""},
	[1047020004] = {id=1047020004,storyid=10470200,pos=4,description="这世界的保护者们并不多，其中半神们有着相当的力量，玛雅更是由于有着元素之力",position=1,expression=""},
	[1047020005] = {id=1047020005,storyid=10470200,pos=5,description="所以他们的半神们的力量也不同于其他半神，在保护世界平衡这点上起到很重要的作用。",position=2,expression=""},
	[1047020006] = {id=1047020006,storyid=10470200,pos=6,description="并非所有的玛雅半神都被邪神的意志所击垮",position=1,expression=""},
	[1047020007] = {id=1047020007,storyid=10470200,pos=7,description="你们在获得图腾之力以及半神恩赐的力量中，是否对于其中的有些事情感觉到古怪？",position=2,expression=""},
	[1047020008] = {id=1047020008,storyid=10470200,pos=8,description="……我来想想……",position=1,expression=""},
	[1047020009] = {id=1047020009,storyid=10470200,pos=9,description="你是说乌鸦之神以及它的图腾？",position=2,expression=""},
	[1047020010] = {id=1047020010,storyid=10470200,pos=10,description="喵喵喵？？？？",position=1,expression=""},
	[1047020011] = {id=1047020011,storyid=10470200,pos=11,description="我们在之前获得乌鸦之神的赐福与图腾之力中，并没有接受考验，你还有印象吗？",position=2,expression=""},
	[1047020012] = {id=1047020012,storyid=10470200,pos=12,description="好像是这样的呢。",position=1,expression=""},
	[1047020013] = {id=1047020013,storyid=10470200,pos=13,description="你的意思是……",position=2,expression=""},
	[1047020014] = {id=1047020014,storyid=10470200,pos=14,description="是的，想必你已经有的答案,乌鸦之神早已觉醒，他是玛雅几个半神中最为活跃的存在",position=1,expression=""},
	[1047020015] = {id=1047020015,storyid=10470200,pos=15,description="他应该已经亲自观察了这个世界的剧变，并决心降临于世。这也对应了乌鸦降世的预言。",position=2,expression=""},
	[1047020016] = {id=1047020016,storyid=10470200,pos=16,description="这么说来，情况还不算太糟糕。",position=1,expression=""},
	[1047020017] = {id=1047020017,storyid=10470200,pos=17,description="你们在说什么呀？我怎么一句都听不懂？",position=2,expression=""},
	[1047020018] = {id=1047020018,storyid=10470200,pos=18,description="你能听懂才算奇怪呢！",position=1,expression=""},
	[1047020019] = {id=1047020019,storyid=10470200,pos=19,description="去埃及吧，我替你们进行了一道预言，埃及的金沙城将会是下一个大事件的地点，你们也要准备准备了。",position=2,expression=""},
	[1047020020] = {id=1047020020,storyid=10470200,pos=20,description="库库尔坎，要不你也跟我们一起去冒险吧？",position=1,expression=""},
	[1047020021] = {id=1047020021,storyid=10470200,pos=21,description="有这个想法，但现在不是时候，玛雅岛需要重建，我这个大祭司要进行赎罪",position=2,expression=""},
	[1047020022] = {id=1047020022,storyid=10470200,pos=22,description="等到重建完毕，我就会动身去找你们的，没问题吧，伊维尔？",position=1,expression=""},
	[1047020023] = {id=1047020023,storyid=10470200,pos=23,description="……那个~我才是船长~",position=2,expression=""},
	[1047020024] = {id=1047020024,storyid=10470200,pos=24,description="虽然很讨厌你，但是现在不是讨厌你的时候！",position=1,expression=""},
	[1047020025] = {id=1047020025,storyid=10470200,pos=25,description="是的呢，这个世界的平衡已被打破……这个星球的命运又会是怎么样的呢……",position=2,expression=""},
	[1047020026] = {id=1047020026,storyid=10470200,pos=26,description="不管这个星球的命运如何，只要本船长还存在于这个星球，就不会让它毁灭！",position=1,expression=""},
	[1047020027] = {id=1047020027,storyid=10470200,pos=27,description="真是一个美丽帅气的船长！",position=2,expression=""},
	[1047020028] = {id=1047020028,storyid=10470200,pos=28,description="是我的船长！你快走开啦~走开啦~船长，我们赶紧出发吧~",position=1,expression=""},
	[1047030001] = {id=1047030001,storyid=10470300,pos=1,description="玛雅的旅程也要告一段落了",position=1,expression=""},
	[1099010001] = {id=1099010001,storyid=10990100,pos=1,description="今天收获真不错",position=1,expression=""},
	[1099010002] = {id=1099010002,storyid=10990100,pos=2,description="是啊，我们可以发一波大财了~",position=1,expression=""},
	[1099010003] = {id=1099010003,storyid=10990100,pos=3,description="这里就是伐木岛吗？我们能在这里开采吗？",position=1,expression=""},
	[1099010004] = {id=1099010004,storyid=10990100,pos=4,description="哪里来的黄毛丫头，从哪来的回哪去，这里已经被我们老大承包了赶紧滚。",position=1,expression=""},
	[1099010005] = {id=1099010005,storyid=10990100,pos=5,description="就是就是，等我们老大来了，你们的小命就没了",position=2,expression=""},
	[1099010006] = {id=1099010006,storyid=10990100,pos=6,description="那好吧，这座岛本船长准备接手了",position=1,expression=""},
	[1099020001] = {id=1099020001,storyid=10990200,pos=1,description="杰克！我一定要找到杰克，就是他放火烧了我的村子！",position=1,expression=""},
	[1099020002] = {id=1099020002,storyid=10990200,pos=2,description="你冷静一点，我们现在要隐匿行踪！ ",position=1,expression=""},
	[1099020003] = {id=1099020003,storyid=10990200,pos=3,description="你们两个鬼鬼祟祟的在干什么？ ",position=1,expression=""},
	[1099020004] = {id=1099020004,storyid=10990200,pos=4,description="糟糕，赶快遛~",position=1,expression=""},
	[1099020005] = {id=1099020005,storyid=10990200,pos=5,description="还想走？你们已经被我们盯上好久啦~",position=2,expression=""},
	[1099020006] = {id=1099020006,storyid=10990200,pos=6,description="乖乖放下武器投降吧，小的们把他们围起来",position=1,expression=""},
	[1099020007] = {id=1099020007,storyid=10990200,pos=7,description="别别别，别动手，我们配合。",position=1,expression=""},
	[1099020008] = {id=1099020008,storyid=10990200,pos=8,description="你！",position=2,expression=""},
	[1099020009] = {id=1099020009,storyid=10990200,pos=9,description="（我估摸着刚刚的船长应该快要到了，别着急着送死啊）",position=1,expression=""},
	[1099030001] = {id=1099030001,storyid=10990300,pos=1,description="挺难对付的,不过还不是我李凡的对手",position=2,expression=""},
	[1099030002] = {id=1099030002,storyid=10990300,pos=2,description="我们终于打败了海盗的首领了，现在我宣布这座岛归……",position=1,expression=""},
	[1099030003] = {id=1099030003,storyid=10990300,pos=3,description="美女船长~感谢你们打败了杰克，就是他烧了我的村庄",position=1,expression=""},
	[1099030004] = {id=1099030004,storyid=10990300,pos=4,description="然而他只是这个强盗组织的中层人物，“烟鬼”才是这群强盗的首领",position=2,expression=""},
	[1099030005] = {id=1099030005,storyid=10990300,pos=5,description="击败他，强盗组织就彻底完蛋了，他就在不远处的“经理办公室”",position=1,expression=""},
	[1099030006] = {id=1099030006,storyid=10990300,pos=6,description="我们需要大量的木材资源，打败了他，这座岛被我们承包啦~ ",position=2,expression=""},
	[1099030007] = {id=1099030007,storyid=10990300,pos=7,description="这……",position=1,expression=""},
	[1099030008] = {id=1099030008,storyid=10990300,pos=8,description="但你们也可以开采啦~",position=2,expression=""},
	[1099030009] = {id=1099030009,storyid=10990300,pos=9,description="好的船长！我们会缴纳上好的木材，算是对你们的感谢",position=1,expression=""},
	[1099040001] = {id=1099040001,storyid=10990400,pos=1,description="你就是号称“烟鬼”的强盗头子？乖乖束手就擒吧！",position=2,expression=""},
	[1099040002] = {id=1099040002,storyid=10990400,pos=2,description="我当是谁这么闹腾呢？一群小屁孩子 ",position=1,expression=""},
	[1099040003] = {id=1099040003,storyid=10990400,pos=3,description="不过挺有胆量的，竟敢直闯“经理办公室”，但烟中饿鬼可不会对弱者感兴趣",position=2,expression=""},
	[1099040004] = {id=1099040004,storyid=10990400,pos=4,description="来人，将他们拿下，囚禁起来。",position=1,expression=""},
	[1099040005] = {id=1099040005,storyid=10990400,pos=5,description="好的老大",position=2,expression=""},
	[1099040006] = {id=1099040006,storyid=10990400,pos=6,description="是",position=1,expression=""},
	[1099040007] = {id=1099040007,storyid=10990400,pos=7,description="遵命",position=2,expression=""},
	[1099050001] = {id=1099050001,storyid=10990500,pos=1,description="粮仓怎么着火啦",position=1,expression=""},
	[1099050002] = {id=1099050002,storyid=10990500,pos=2,description="新劫，赶紧叫人来灭火，越多越好",position=2,expression=""},
	[1099050003] = {id=1099050003,storyid=10990500,pos=3,description="墨斯，我们先去救火，等烧完了我就就没有吃的啦",position=1,expression=""},
	[1099050004] = {id=1099050004,storyid=10990500,pos=4,description="好……好的",position=1,expression=""},
	[1099050005] = {id=1099050005,storyid=10990500,pos=5,description="好的，我去通报各个营地的兄弟们",position=2,expression=""},
	[1099060001] = {id=1099060001,storyid=10990600,pos=1,description="现在自称烟中饿鬼的强盗头子已经被我们击败了",position=1,expression=""},
	[1099060002] = {id=1099060002,storyid=10990600,pos=2,description="按照本船长自己颁布的法典，现在这座伐木岛已经归属于本舰队",position=1,expression=""},
	[1099060003] = {id=1099060003,storyid=10990600,pos=3,description="只要村民们愿意交纳少许的资源，本船长就会提供庇护，让你们安心生产",position=2,expression=""},
	[1099060004] = {id=1099060004,storyid=10990600,pos=4,description="（嘿嘿嘿~我已经是承包大户啦） ",position=1,expression=""},
	[1099060005] = {id=1099060005,storyid=10990600,pos=5,description="美女船长万岁~~~~~~~~",position=1,expression=""},
	[1099060006] = {id=1099060006,storyid=10990600,pos=6,description="美女船长我爱你！！！！！！",position=2,expression=""},
	[1099060007] = {id=1099060007,storyid=10990600,pos=7,description="你是我的天使！！！！",position=1,expression=""},
	[1099060008] = {id=1099060008,storyid=10990600,pos=8,description="让我们追随你吧~~~~",position=1,expression=""},
	[1099060009] = {id=1099060009,storyid=10990600,pos=9,description="这算是我们第一个资源开采点了，一定要好好保护起来",position=1,expression=""},
	[1099060010] = {id=1099060010,storyid=10990600,pos=10,description="对，攻岛易，守岛难，我们需要制定相关计划",position=2,expression=""},
	[1099060011] = {id=1099060011,storyid=10990600,pos=11,description="嘿嘿~看我的~",position=1,expression=""},
	[1099060013] = {id=1099060013,storyid=10990600,pos=13,description="我也爱你们~那……你们愿意为我守护这座伐木岛吗 ？",position=1,expression=""},
	[1099060014] = {id=1099060014,storyid=10990600,pos=14,description="我们愿意！！！！！！！！",position=2,expression=""},
	[1099060015] = {id=1099060015,storyid=10990600,pos=15,description="追随船长一万年！！！",position=1,expression=""},
	[1099060016] = {id=1099060016,storyid=10990600,pos=16,description="无条件支持船长~~~~~~~~~~~",position=1,expression=""},
	[1099070001] = {id=1099070001,storyid=10990700,pos=1,description="没有被人发现~哈哈",position=1,expression=""},
	[1099070002] = {id=1099070002,storyid=10990700,pos=2,description="话说我们不是冒险来着吗？怎么偷起东西来了额。",position=2,expression=""},
	[1099070003] = {id=1099070003,storyid=10990700,pos=3,description="海盗们的财富来自掠夺，我们自然也要用海盗的法则对待对待他们。",position=1,expression=""},
	[1099070004] = {id=1099070004,storyid=10990700,pos=4,description="我要找找有没有小鱼干!",position=1,expression=""},
	[1099070005] = {id=1099070005,storyid=10990700,pos=5,description="听说海盗们十分擅长藏匿贵重的物品呢~",position=2,expression=""},
	[1099070006] = {id=1099070006,storyid=10990700,pos=6,description="是吗？我要找到海盗们的宝藏！！！",position=1,expression=""},
	[1099080001] = {id=1099080001,storyid=10990800,pos=1,description="二位研究员，您在这里做什么呢？这里空无人烟还挺危险的。",position=1,expression=""},
	[1099080002] = {id=1099080002,storyid=10990800,pos=2,description="好心的船长，这里是克洛斯王国的遗迹",position=1,expression=""},
	[1099080003] = {id=1099080003,storyid=10990800,pos=3,description="现在遗迹内部已然腐朽，不明原因导致了遗迹内生物发生了强烈的“异化现象”",position=2,expression=""},
	[1099080004] = {id=1099080004,storyid=10990800,pos=4,description="附近已经发生了多起异化蜘蛛袭击村民的事件",position=1,expression=""},
	[1099080005] = {id=1099080005,storyid=10990800,pos=5,description="我正在此地调查导致蜘蛛们变异的原因",position=1,expression=""},
	[1099080006] = {id=1099080006,storyid=10990800,pos=6,description="以及看能否研制出清理蜘蛛毒素的药剂来帮助村民们",position=2,expression=""},
	[1099080007] = {id=1099080007,storyid=10990800,pos=7,description="真是一个敬业的研究员，现在我们要进去冒险了",position=1,expression=""},
	[1099080008] = {id=1099080008,storyid=10990800,pos=8,description="您说说里面哪里会大几率搜寻到对您有用的东西，我们一定会多加留意的",position=1,expression=""},
	[1099080009] = {id=1099080009,storyid=10990800,pos=9,description="看能不能给您帮上一点点忙",position=1,expression=""},
	[1099080010] = {id=1099080010,storyid=10990800,pos=10,description="那真是太感谢你了,首先……然后……",position=2,expression=""},
	[1099080011] = {id=1099080011,storyid=10990800,pos=11,description="克洛斯王国的遗迹吗？想想还挺有意思呢",position=1,expression=""},
	[1099080013] = {id=1099080013,storyid=10990800,pos=13,description="“蓝焰骑士团”的长老们曾经跟我提及过“覆灭的克洛斯”，我也挺想了解一下。",position=1,expression=""},
	[1099080014] = {id=1099080014,storyid=10990800,pos=14,description="导师，你要的蜘蛛标本我找到了",position=2,expression=""},
	[1099080015] = {id=1099080015,storyid=10990800,pos=15,description="小黄的蜘蛛标本啥时候能够送过来呀，我这边着急着要用呢",position=1,expression=""},
	[1099080016] = {id=1099080016,storyid=10990800,pos=16,description="额~看来大家对此地都有一些渊源啊。",position=2,expression=""},
	[1099090001] = {id=1099090001,storyid=10990900,pos=1,description="我看我们直接闯进去强行救人得了~",position=1,expression=""},
	[1099090002] = {id=1099090002,storyid=10990900,pos=2,description="不行，这样风险太大，我们可能连人都救不到，就被怪物们撕碎了",position=1,expression=""},
	[1099090003] = {id=1099090003,storyid=10990900,pos=3,description="那怎么办？要见死不救吗？没那么多时间思考了。你不愿意去我就一个人去",position=2,expression=""},
	[1099090004] = {id=1099090004,storyid=10990900,pos=4,description="这不是陈叔吗？看样子你们遇到麻烦了？",position=1,expression=""},
	[1099090005] = {id=1099090005,storyid=10990900,pos=5,description="不是见死不见……但是救也要讲究策略",position=1,expression=""},
	[1099090006] = {id=1099090006,storyid=10990900,pos=6,description="你们来得正好，这里面有许多村民都危在旦夕，怪物们封锁了去路，我们正为此争吵呢。",position=2,expression=""},
	[1099090007] = {id=1099090007,storyid=10990900,pos=7,description="原来是这样呀，大概情况我们了解了，让我们来祝你们一臂之力吧。",position=1,expression=""},
	[1099100001] = {id=1099100001,storyid=10991000,pos=1,description="不行了……我要饿晕过去了",position=1,expression=""},
	[1099100002] = {id=1099100002,storyid=10991000,pos=2,description="我……我已经……6天没有吃饭了",position=1,expression=""},
	[1099100003] = {id=1099100003,storyid=10991000,pos=3,description="小伙伴，你为何在此哭泣呀？",position=2,expression=""},
	[1099100004] = {id=1099100004,storyid=10991000,pos=4,description="距离粮食危机已经好一段时间了，原本现在已经到了粮食收获的季节，我本来是来负责收割粮食解决危机的",position=1,expression=""},
	[1099100005] = {id=1099100005,storyid=10991000,pos=5,description="但是大家都饿晕了过去，里面又有好多怪物，我现在也不知道怎么办才好",position=1,expression=""},
	[1099100006] = {id=1099100006,storyid=10991000,pos=6,description="原来是为此事烦恼着，别担心！我们会替你收拾了里面的怪物。",position=2,expression=""},
	[1099100007] = {id=1099100007,storyid=10991000,pos=7,description="",position=1,expression=""},
	[1099100008] = {id=1099100008,storyid=10991000,pos=8,description="我也要来帮忙~不能一味的依赖他人，我也想要变得跟你们一样的强，然后保护弱者！",position=1,expression=""},
	[1099100009] = {id=1099100009,storyid=10991000,pos=9,description="哈哈，你一定能够做到的，那么你这一次先走在我们队伍的后方哦",position=1,expression=""},
	[1099100010] = {id=1099100010,storyid=10991000,pos=10,description="好的~",position=2,expression=""},
	[1099100011] = {id=1099100011,storyid=10991000,pos=11,description="呜呜呜~大家",position=1,expression=""},
	[1099110001] = {id=1099110001,storyid=10991100,pos=1,description="交出艾达拉女王，罗德斯亲王必定会绕你们不死",position=1,expression=""},
	[1099110002] = {id=1099110002,storyid=10991100,pos=2,description="少废话，我从小就誓死守卫女王陛下",position=1,expression=""},
