	[20501] = {id=20501,storyid=205,pos=1,description="是叶小胖不是糖丸……",position=2,expression=""},
	[20601] = {id=20601,storyid=206,pos=1,description="唔……我看看……在东北方向的月落小镇？",position=1,expression=""},
	[20602] = {id=20602,storyid=206,pos=2,description="上北下南，左西右东……",position=1,expression=""},
	[20603] = {id=20603,storyid=206,pos=3,description="嗯？右边是哪边？",position=1,expression=""},
	[20604] = {id=20604,storyid=206,pos=4,description="船长……你地图好像拿反了",position=2,expression=""},
	[20605] = {id=20605,storyid=206,pos=5,description="啊？啊哈哈……其实我有特殊的看地图技巧",position=1,expression=""},
	[20606] = {id=20606,storyid=206,pos=6,description="我们小镇上是有个大铁锅的，应该很显眼",position=2,expression=""},
	[20607] = {id=20607,storyid=206,pos=7,description="大铁锅？没错，我一眼就看到了~",position=1,expression=""},
