	[11801] = {id=11801,storyid=118,pos=1,description="走吧我们去找小鱼干！",position=2,expression=""},
	[12101] = {id=12101,storyid=121,pos=1,description="这里发生什么事情了！",position=1,expression=""},
	[12102] = {id=12102,storyid=121,pos=2,description="镇上已经饥荒好多天了……",position=2,expression=""},
	[12201] = {id=12201,storyid=122,pos=1,description="我觉得我可以吃下一头牛……",position=2,expression=""},
	[12202] = {id=12202,storyid=122,pos=2,description="没东西吃要死了……",position=2,expression=""},
	[12203] = {id=12203,storyid=122,pos=3,description="这树根…有毒……",position=2,expression=""},
	[12204] = {id=12204,storyid=122,pos=4,description="早知今日，前些天的剩饭就不该倒……",position=2,expression=""},
	[12301] = {id=12301,storyid=123,pos=1,description="再没有吃的，我也撑不下去了……",position=2,expression=""},
	[12302] = {id=12302,storyid=123,pos=2,description="我们船上带了些食物，我这就去给你拿",position=1,expression=""},
	[12401] = {id=12401,storyid=124,pos=1,description="这肯定是之前掳走我的那些强盗害的，他们走的时候带走了好多粮食！",position=2,expression=""},
	[12402] = {id=12402,storyid=124,pos=2,description="现在我们的食物也不多了，可是镇子上肯定还有很多人没有吃的，怎么办",position=1,expression=""},
	[12403] = {id=12403,storyid=124,pos=3,description="食物没有，种子倒是有一堆，如果有能让种子很快成长的土地就好了",position=2,expression=""},
	[12404] = {id=12404,storyid=124,pos=4,description="镇子上的美食塔里，有一个种植房，那里种下的东西，总是能很快成熟！",position=2,expression=""},
	[12405] = {id=12405,storyid=124,pos=5,description="那还等什么，我们去美食塔！",position=1,expression=""},
	[12501] = {id=12501,storyid=125,pos=1,description="美食塔的种植房一直是镇子上的陈叔负责看守的",position=2,expression=""},
	[12502] = {id=12502,storyid=125,pos=2,description="对我可好了，我们去一定可以借到种植房用的",position=2,expression=""},
	[12503] = {id=12503,storyid=125,pos=3,description="不过他有点近视，戴上眼镜也是一百米外人畜不分，等下我们和他说话站近点",position=2,expression=""},
	[12504] = {id=12504,storyid=125,pos=4,description="嗯嗯，了解~",position=1,expression=""},
	[12601] = {id=12601,storyid=126,pos=1,description="呔！小毛贼，站住！",position=2,expression=""},
	[12602] = {id=12602,storyid=126,pos=2,description="你从哪里看出来我们是小毛贼！",position=1,expression=""},
	[12603] = {id=12603,storyid=126,pos=3,description="哼，不请自入，都是贼！小黑，上！",position=2,expression=""},
	[12604] = {id=12604,storyid=126,pos=4,description="汪！",position=2,expression=""},
	[12605] = {id=12605,storyid=126,pos=5,description="哇哦！伊凡帅呆了！",position=1,expression=""},
	[12606] = {id=12606,storyid=126,pos=6,description="啪啪啪，鼓掌！",position=1,expression=""},
	[12607] = {id=12607,storyid=126,pos=7,description="别打了别打了，自己人自己人……",position=2,expression=""},
	[12608] = {id=12608,storyid=126,pos=8,description="混账，谁跟你们是自己人！",position=2,expression=""},
	[12609] = {id=12609,storyid=126,pos=9,description="陈叔你眼镜戴上再说话……",position=2,expression=""},
	[12610] = {id=12610,storyid=126,pos=10,description="……你怎么知道我眼镜是画上去的？",position=2,expression=""},
	[12701] = {id=12701,storyid=127,pos=1,description="陈叔说，之前强盗来镇上的时候，种植房就被毁了，不过给了我图纸，我们可以自己造一个",position=2,expression=""},
	[12702] = {id=12702,storyid=127,pos=2,description="只是陈叔也不知道为什么强盗走后塔里就出现了怪物，他守在种植房太久没出来过了",position=2,expression=""},
	[12703] = {id=12703,storyid=127,pos=3,description="先把食物种出来，我们再去塔里调查一下吧！",position=1,expression=""},
	[12801] = {id=12801,storyid=128,pos=1,description="累啊……",position=1,expression=""},
	[12802] = {id=12802,storyid=128,pos=2,description="要是一个一个送食物的话，我们才五个人，什么时候送的完呐",position=1,expression=""},
	[12803] = {id=12803,storyid=128,pos=3,description="高贵的猫神送餐摔倒了，要小鱼干才能爬起来……",position=2,expression=""},
	[12804] = {id=12804,storyid=128,pos=4,description="其实我们可以通知他们这里有东西吃，然后摆几个桌椅，等他们过来就行了",position=1,expression=""},
	[12805] = {id=12805,storyid=128,pos=5,description="对哦！叶小胖叶小胖，我们摆个摊吧！",position=1,expression=""},
	[12806] = {id=12806,storyid=128,pos=6,description="我们可以像那些话本子里说的一样，摆个施粥铺",position=2,expression=""},
	[12807] = {id=12807,storyid=128,pos=7,description="醒醒，我们有桌子就不错了",position=2,expression=""},
	[12808] = {id=12808,storyid=128,pos=8,description="话说我们船上还有多余的桌椅？",position=1,expression=""},
	[12901] = {id=12901,storyid=129,pos=1,description="这么多人需要食物，我们没有桌椅设施，可能会很麻烦",position=2,expression=""},
	[12902] = {id=12902,storyid=129,pos=2,description="先前看到美食塔里是有设施的，清理掉那些怪物，我们就可以搬过来！",position=1,expression=""},
	[13001] = {id=13001,storyid=130,pos=1,description="好啦，现在可以摆个场地出来啦！",position=1,expression=""},
	[13101] = {id=13101,storyid=131,pos=1,description="好像有点开露天餐厅的感觉呢！",position=1,expression=""},
	[13102] = {id=13102,storyid=131,pos=2,description="大……排档？",position=2,expression=""},
	[13103] = {id=13103,storyid=131,pos=3,description="我们大概有文化差异",position=1,expression=""},
	[13104] = {id=13104,storyid=131,pos=4,description="谁允许你们在这里开餐厅的！根据大陆经营条例，无证经营要被强拆！",position=2,expression=""},
	[13105] = {id=13105,storyid=131,pos=5,description="小的们，给我砸！",position=2,expression=""},
	[13106] = {id=13106,storyid=131,pos=6,description="再看见你们摆一次，我就砸一次！",position=2,expression=""},
	[13107] = {id=13107,storyid=131,pos=7,description="大陆经营条例……？",position=1,expression=""},
	[13108] = {id=13108,storyid=131,pos=8,description="没听过啊",position=2,expression=""},
	[13109] = {id=13109,storyid=131,pos=9,description="我……也没听过这样的规定",position=2,expression=""},
	[13110] = {id=13110,storyid=131,pos=10,description="这种时候！我们难道不应该先打他们一顿再讲规定嘛！",position=2,expression=""},
	[13201] = {id=13201,storyid=132,pos=1,description="那些怪物，肯定是骗我们的！",position=2,expression=""},
	[13202] = {id=13202,storyid=132,pos=2,description="欠打，怼他！",position=1,expression=""},
	[13301] = {id=13301,storyid=133,pos=1,description="果然没有什么见鬼的管理条例，打他们一顿就老实了",position=1,expression=""},
	[13302] = {id=13302,storyid=133,pos=2,description="他们其实也提醒了我，我们在外面摆这些设施，不如去船内摆，让这些人都去船内吃饭吧",position=2,expression=""},
	[13303] = {id=13303,storyid=133,pos=3,description="海上移动餐厅？这个好~我们以后还可以靠这个发家致富！",position=1,expression=""},
	[13304] = {id=13304,storyid=133,pos=4,description="嗯哼…你开心就好",position=2,expression=""},
	[13401] = {id=13401,storyid=134,pos=1,description="你们小镇好像正在闹饥荒？",position=1,expression=""},
	[13501] = {id=13501,storyid=135,pos=1,description="好饿……",position=2,expression=""},
	[13601] = {id=13601,storyid=136,pos=1,description="哼！",position=2,expression=""},
	[13701] = {id=13701,storyid=137,pos=1,description="三天前…",position=2,expression=""},
	[13801] = {id=13801,storyid=138,pos=1,description="海盗来了！",position=2,expression=""},
	[13802] = {id=13802,storyid=138,pos=2,description="娘咧……",position=2,expression=""},
	[13803] = {id=13803,storyid=138,pos=3,description="<懵圈>",position=2,expression=""},
	[13804] = {id=13804,storyid=138,pos=4,description="<瑟瑟发抖>",position=2,expression=""},
	[13901] = {id=13901,storyid=139,pos=1,description="总算解决了你们小镇饥荒的问题啦，你怎么看上去不太高兴？",position=1,expression=""},
	[13902] = {id=13902,storyid=139,pos=2,description="没有，我只是在想，为什么我们镇子会突然又遇强盗又遇怪物的",position=2,expression=""},
	[13903] = {id=13903,storyid=139,pos=3,description="那些怪物使用的力量有一股邪恶的气息，我以前好像在哪里遇到过",position=2,expression=""},
	[13904] = {id=13904,storyid=139,pos=4,description="我也感觉有点熟悉，我好像在金沙城见过",position=2,expression=""},
	[13905] = {id=13905,storyid=139,pos=5,description="这么说来，你被突然绑架到克诺斯说不说也和这股力量有关",position=2,expression=""},
	[13906] = {id=13906,storyid=139,pos=6,description="我必须回去一趟，但是我们现在想要到金沙城好像不太可能……",position=2,expression=""},
	[13907] = {id=13907,storyid=139,pos=7,description="海上到处都是风暴和海盗",position=2,expression=""},
	[13908] = {id=13908,storyid=139,pos=8,description="地图上我们附近就是艾尔森林，那里的大祭司说不定能给我们一些帮助",position=2,expression=""},
	[13909] = {id=13909,storyid=139,pos=9,description="艾尔森林？在哪个方向？",position=1,expression=""},
	[13910] = {id=13910,storyid=139,pos=10,description="哈哈哈路痴也需要知道方向嘛？",position=2,expression=""},
	[14001] = {id=14001,storyid=140,pos=1,description="艾·尔·森·林……啊，看来到地方啦",position=1,expression=""},
	[14101] = {id=14101,storyid=141,pos=1,description="我怎么感觉，这里安静得有点过分了，连一声鸟鸣都没有",position=2,expression=""},
	[14102] = {id=14102,storyid=141,pos=2,description="有只树精，不如问问情况",position=1,expression=""},
	[14201] = {id=14201,storyid=142,pos=1,description="一阵淡绿色的迷雾飘来……",position=2,expression=""},
	[14202] = {id=14202,storyid=142,pos=2,description="怎么突然到这里来了！",position=1,expression=""},
	[14203] = {id=14203,storyid=142,pos=3,description="应该是中了一个传送法术，小心！我感觉这里有点不对劲！",position=2,expression=""},
	[14301] = {id=14301,storyid=143,pos=1,description="可恶的闯入者！你们很快就会被自然的力量吞噬的！很快……",position=2,expression=""},
	[14302] = {id=14302,storyid=143,pos=2,description="好……好凶！",position=2,expression=""},
	[14303] = {id=14303,storyid=143,pos=3,description="嗯，超凶",position=2,expression=""},
	[14304] = {id=14304,storyid=143,pos=4,description="据说，艾尔森林的树精是安瑞尔大陆上最爱好和平的种族……",position=2,expression=""},
	[14305] = {id=14305,storyid=143,pos=5,description="……呵呵",position=2,expression=""},
	[14401] = {id=14401,storyid=144,pos=1,description="好险，什么爱好和平的树精，这简直比深渊魔物还凶残！",position=1,expression=""},
	[14402] = {id=14402,storyid=144,pos=2,description="刚才那个地方，应该是艾尔森林的元素之塔",position=2,expression=""},
	[14403] = {id=14403,storyid=144,pos=3,description="元素之塔？我记得你说那位大祭司住的地方就叫元素之塔",position=1,expression=""},
	[14404] = {id=14404,storyid=144,pos=4,description="没错，看来艾尔森林发生了什么变故……",position=2,expression=""},
	[14405] = {id=14405,storyid=144,pos=5,description="现在怎么办，打不过那些树精，我们根本不可能上去找大祭司",position=1,expression=""},
	[14406] = {id=14406,storyid=144,pos=6,description="可以问问刚刚救的那些本地居民，他们可能知道什么",position=2,expression=""},
	[14501] = {id=14501,storyid=145,pos=1,description="谢谢你们救了我们",position=2,expression=""},
	[14502] = {id=14502,storyid=145,pos=2,description="你们的大祭司呢？",position=1,expression=""},
	[14503] = {id=14503,storyid=145,pos=3,description="大祭司之前还为树精暴乱的问题出现过，后来就回到塔上了，我们本来也是去找大祭司求助的",position=2,expression=""},
	[14504] = {id=14504,storyid=145,pos=4,description="看了还是要上去看看才知道发生什么了，可是那些树精太强了，可怎么办",position=1,expression=""},
	[14505] = {id=14505,storyid=145,pos=5,description="如果你们是因为人手问题，那不如去佣兵之岛看一看，据说那里只要有足够的佣金，就能找到合意的帮手",position=2,expression=""},
	[14506] = {id=14506,storyid=145,pos=6,description="还有这样的地方！谢啦~我们一定会去看看的！",position=1,expression=""},
	[14601] = {id=14601,storyid=146,pos=1,description="我们现在应该可以去找大祭司了！",position=1,expression=""},
	[14602] = {id=14602,storyid=146,pos=2,description="不过之前看到那些树精都能在元素之塔里面搞破坏了，却没有看见大祭司的踪影，她会不会……",position=1,expression=""},
	[14603] = {id=14603,storyid=146,pos=3,description="不管遇到了什么，以她的能力，都不可能毫无声息的失踪",position=2,expression=""},
	[14604] = {id=14604,storyid=146,pos=4,description="那她的住处应该会有什么线索",position=1,expression=""},
	[14701] = {id=14701,storyid=147,pos=1,description="那边那个人，是不是大祭司！",position=1,expression=""},
	[14801] = {id=14801,storyid=148,pos=1,description="大祭司居然攻击我们？什么情况！",position=1,expression=""},
	[14901] = {id=14901,storyid=149,pos=1,description="大祭司即使使用攻击法术，能量也是充满生机的，可是刚才那个人……",position=2,expression=""},
	[14902] = {id=14902,storyid=149,pos=2,description="那种黑暗又邪恶的能量……难道那个人不是大祭司？",position=1,expression=""},
	[14903] = {id=14903,storyid=149,pos=3,description="追上那个人，一定要问出大祭司的下落！",position=2,expression=""},
	[15001] = {id=15001,storyid=150,pos=1,description="奇怪，那个人跑哪里去了？",position=1,expression=""},
	[15002] = {id=15002,storyid=150,pos=2,description="我感觉到有深渊魔物的气息……",position=2,expression=""},
	[15101] = {id=15101,storyid=151,pos=1,description="什么？！真有深渊魔物？那些东西不是早被封印几百年了嘛！",position=1,expression=""},
	[15102] = {id=15102,storyid=151,pos=2,description="既然是几百年前的封印，现在松动了或者损坏了也很正常不是嘛",position=2,expression=""},
	[15103] = {id=15103,storyid=151,pos=3,description="啊……好吧，希望我们遇到的不是高级魔物",position=1,expression=""},
	[15201] = {id=15201,storyid=152,pos=1,description="呵呵呵……破坏了迪塞尔大人的祭品，看来你们已经准备好承受神的怒火了",position=2,expression=""},
	[15202] = {id=15202,storyid=152,pos=2,description="区区深渊的小魔物，也敢妄自称神！",position=2,expression=""},
	[15203] = {id=15203,storyid=152,pos=3,description="希望下次见面时，你们还能像今天这样，有着愚蠢的勇气……",position=2,expression=""},
	[15204] = {id=15204,storyid=152,pos=4,description="我这是……怎么了？",position=2,expression=""},
	[15301] = {id=15301,storyid=153,pos=1,description="非常感谢你们的帮助",position=2,expression=""},
	[15401] = {id=15401,storyid=154,pos=1,description="森林中的树精突然变得非常具有攻击性，我原本在研究让它们恢复正常的办法，却在它们的枝叶中发现了奇怪的能量",position=2,expression=""},
	[15402] = {id=15402,storyid=154,pos=2,description="我收集了这些能量，准备分析其中的成分时却突然失去了意识",position=2,expression=""},
	[15403] = {id=15403,storyid=154,pos=3,description="伊维尔和我说了你们想要去金沙城，那里的风暴很厉害，如果没有足够坚固的船身，是无法承受海浪的拍击的",position=2,expression=""},
	[15404] = {id=15404,storyid=154,pos=4,description="不过，如果维鲁大师肯帮你们做一艘船，那就没有问题了~",position=2,expression=""},
	[15405] = {id=15405,storyid=154,pos=5,description="维鲁大师？就是那个很出名的几大神匠之一的维鲁大师？",position=1,expression=""},
	[15406] = {id=15406,storyid=154,pos=6,description="对，虽然他脾气古怪，近几年更是很少出手给人做东西了",position=2,expression=""},
	[15407] = {id=15407,storyid=154,pos=7,description="但是你们不一样，你们这次帮了艾尔森林这么大的忙，他应该不会为难你们的",position=2,expression=""},
	[15408] = {id=15408,storyid=154,pos=8,description="我还要去查看一下树精们的情况，就先失陪了，艾尔森林永远欢迎你们的到来",position=2,expression=""},
	[15501] = {id=15501,storyid=155,pos=1,description="天啦，我们居然可以让神匠给我们造船！",position=1,expression=""},
	[15502] = {id=15502,storyid=155,pos=2,description="这可真是意外之喜~",position=2,expression=""},
	[15503] = {id=15503,storyid=155,pos=3,description="走吧，我们去看看神匠长什么样！",position=1,expression=""},
	[15601] = {id=15601,storyid=156,pos=1,description="你好，请问你是维鲁大师嘛？",position=1,expression=""},
	[15602] = {id=15602,storyid=156,pos=2,description="什么维鲁大师！找错人了！走开走开！",position=2,expression=""},
	[15603] = {id=15603,storyid=156,pos=3,description="啊啊，不好意思",position=1,expression=""},
	[15604] = {id=15604,storyid=156,pos=4,description="等等！我看你像个能干的，老头子现在饿了，你们赶快去给我做一份食火鲜盖饭过来！",position=2,expression=""},
	[15605] = {id=15605,storyid=156,pos=5,description="（好气啊，哪里来的古怪老头，居然这样使唤人！咦？脾气古怪的老头？）",position=1,expression=""},
	[15606] = {id=15606,storyid=156,pos=6,description="好的，马上来~",position=1,expression=""},
	[15701] = {id=15701,storyid=157,pos=1,description="维鲁大师，您的食火鲜盖饭~",position=1,expression=""},
	[15702] = {id=15702,storyid=157,pos=2,description="嗯，还不错",position=2,expression=""},
	[15703] = {id=15703,storyid=157,pos=3,description="。。。",position=2,expression=""},
	[15704] = {id=15704,storyid=157,pos=4,description="嘻嘻~",position=1,expression=""},
	[15801] = {id=15801,storyid=158,pos=1,description="哼！耍什么小聪明！我知道你们，赶走了控制大祭司的深渊魔物是吧，那想必其它方面也不逊色",position=2,expression=""},
	[15802] = {id=15802,storyid=158,pos=2,description="想要我帮你们造船，那就先交出足够的金币来，我可不会帮你们做白工！",position=2,expression=""},
	[15803] = {id=15803,storyid=158,pos=3,description="可是……我们身上已经没几个金币了……",position=1,expression=""},
	[15804] = {id=15804,storyid=158,pos=4,description="没钱就赚！艾尔森林那么多人，你们要是给吃的给他们，他们难道还会不付钱嘛！",position=2,expression=""},
	[15805] = {id=15805,storyid=158,pos=5,description="看着我也没用，我可不会给你们打折！",position=2,expression=""},
	[15806] = {id=15806,storyid=158,pos=6,description="……小气鬼",position=1,expression=""},
	[15807] = {id=15807,storyid=158,pos=7,description="你说什么？",position=2,expression=""},
	[15808] = {id=15808,storyid=158,pos=8,description="没有没有，我们马上开始赚钱！",position=1,expression=""},
	[15901] = {id=15901,storyid=159,pos=1,description="维鲁大师，这是您要的金币……",position=1,expression=""},
	[16001] = {id=16001,storyid=160,pos=1,description="好了，那你们去砍木头吧",position=2,expression=""},
	[16002] = {id=16002,storyid=160,pos=2,description="砍…砍木头？",position=1,expression=""},
	[16003] = {id=16003,storyid=160,pos=3,description="没有木材，我给你们空手变船嘛！",position=2,expression=""},
	[16004] = {id=16004,storyid=160,pos=4,description="不，不是！我们马上去砍木头！",position=1,expression=""},
	[16005] = {id=16005,storyid=160,pos=5,description="艾尔森林的树不准砍，知道没！",position=2,expression=""},
	[16006] = {id=16006,storyid=160,pos=6,description="为什么？！",position=1,expression=""},
	[16007] = {id=16007,storyid=160,pos=7,description="哪来这么多为什么！你会愿意把你家拆了给别人做船？！",position=2,expression=""},
	[16008] = {id=16008,storyid=160,pos=8,description="。。。",position=1,expression=""},
	[16009] = {id=16009,storyid=160,pos=9,description="现在的年轻人，就是浮躁！做点小事就东问西问，叽叽歪歪……",position=2,expression=""},
	[16101] = {id=16101,storyid=161,pos=1,description="这些木材够用嘛？",position=1,expression=""},
	[16102] = {id=16102,storyid=161,pos=2,description="嗯，没你事了，做好了给你",position=2,expression=""},
	[16201] = {id=16201,storyid=162,pos=1,description="喏，你的船",position=2,expression=""},
	[16202] = {id=16202,storyid=162,pos=2,description="哇，谢谢大师！",position=1,expression=""},
	[16203] = {id=16203,storyid=162,pos=3,description="行了行了，没事了就别来烦我，走开走开",position=2,expression=""},
	[16301] = {id=16301,storyid=163,pos=1,description="哈哈哈有了这么大的船，还怂什么风暴！",position=1,expression=""},
	[16302] = {id=16302,storyid=163,pos=2,description="我们的资源……",position=2,expression=""},
	[16303] = {id=16303,storyid=163,pos=3,description="怕什么！资源没了就抢海盗的呀！难道只准他们抢我们的，我们不能抢回去？",position=1,expression=""},
	[16304] = {id=16304,storyid=163,pos=4,description="说的很有道理的样子……",position=2,expression=""},
	[16305] = {id=16305,storyid=163,pos=5,description="而且遇不到海盗，还可以抢资源岛呀！既然已经被怪物占了，那当然就能者居之！",position=1,expression=""},
	[16306] = {id=16306,storyid=163,pos=6,description="虽然觉得很有道理，但是感觉哪里不对的样子……",position=2,expression=""},
	[16401] = {id=16401,storyid=164,pos=1,description="……？入侵者！",position=2,expression=""},
	[20701] = {id=20701,storyid=207,pos=1,description="我只是一个路牌",position=2,expression=""},
	[16501] = {id=16501,storyid=165,pos=1,description="好啦，我们的海上餐厅开业啦~",position=1,expression=""},
	[16601] = {id=16601,storyid=166,pos=1,description="回到自己地盘的感觉真好呀喵~",position=2,expression=""},
	[16701] = {id=16701,storyid=167,pos=1,description="你知道绑架你的人是谁嘛？",position=1,expression=""},
	[16702] = {id=16702,storyid=167,pos=2,description="只知道是一个可恶的人类！居然趁我吃东西的时候偷袭我！可惜了我的小鱼干，我还没吃完呢",position=2,expression=""},
	[16703] = {id=16703,storyid=167,pos=3,description="。。。",position=1,expression=""},
	[16704] = {id=16704,storyid=167,pos=4,description="不过没关系，伟大的猫神小伙伴多了去了，找到狗鼻子来帮忙，肯定能循着气味找到那人！",position=2,expression=""},
	[16801] = {id=16801,storyid=168,pos=1,description="诶，奇怪，那只狗最喜欢宅在家里了，怎么没找到他？",position=2,expression=""},
	[16802] = {id=16802,storyid=168,pos=2,description="难道奇怪的不是那些突然攻击我们的怪物么？",position=1,expression=""},
	[16803] = {id=16803,storyid=168,pos=3,description="自从上次去他家看到他堂堂一个神趴在地上啃骨头，我就觉得他家里出现什么都不奇怪了（严肃脸）",position=2,expression=""},
	[16804] = {id=16804,storyid=168,pos=4,description="emmm……",position=1,expression=""},
	[16901] = {id=16901,storyid=169,pos=1,description="你要找的小伙伴不在家，他还可能去别的地方么？",position=1,expression=""},
	[16902] = {id=16902,storyid=169,pos=2,description="他除了在家，就只可能在街道上了呀！",position=2,expression=""},
	[16903] = {id=16903,storyid=169,pos=3,description="可是你看街道上哪里有狗！",position=2,expression=""},
	[16904] = {id=16904,storyid=169,pos=4,description="汪！",position=2,expression=""},
	[16905] = {id=16905,storyid=169,pos=5,description="……",position=2,expression=""},
	[16906] = {id=16906,storyid=169,pos=6,description="这傻狗从哪里冒出来的？（扶额）",position=2,expression=""},
	[17001] = {id=17001,storyid=170,pos=1,description="贝蒂终于回来了！她再不回来，毁灭之神就要彻底破坏封印了！",position=2,expression=""},
	[17002] = {id=17002,storyid=170,pos=2,description="毁灭之神？",position=1,expression=""},
	[17003] = {id=17003,storyid=170,pos=3,description="是的，毁灭之神阿波菲斯，是陨落过无数神明的邪恶魔神，后来被诸神联手封印",position=2,expression=""},
	[17004] = {id=17004,storyid=170,pos=4,description="原本我与贝蒂共同守护封印，可是前段时间贝蒂失踪了，我找遍金沙城，没找到她，却找到了魔物的踪迹",position=2,expression=""},
	[17005] = {id=17005,storyid=170,pos=5,description="当我意识到大事不好的时候，那魔物已经趁我不在，把封印破坏了！",position=2,expression=""},
	[17006] = {id=17006,storyid=170,pos=6,description="贝蒂应该就是被魔物绑架了，就是为了调开你破坏封印，你们现在准备怎么办？",position=1,expression=""},
	[17007] = {id=17007,storyid=170,pos=7,description="只能尽力修复封印了，不管怎样，必须先将入口处的魔物全部清理掉",position=2,expression=""},
	[17008] = {id=17008,storyid=170,pos=8,description="入口处？",position=1,expression=""},
	[17009] = {id=17009,storyid=170,pos=9,description="对……阿波菲斯被封印在冥界混沌之河，那里还有蝎神塞尔凯特看守，但是现在已经完全联系不上她了",position=2,expression=""},
