	[17011] = {id=17011,storyid=170,pos=11,description="嗯！我在前方为你们引路，你们尽快跟上！",position=2,expression=""},
	[17101] = {id=17101,storyid=171,pos=1,description="怎么样？你联系上那位蝎神了么？",position=1,expression=""},
	[17201] = {id=17201,storyid=172,pos=1,description="我刚才去前面看了下，前面魔物很多，根本看不清楚冥界之门的情况，希望还没被攻破，不然蝎神就危险了",position=2,expression=""},
	[17202] = {id=17202,storyid=172,pos=2,description="看来只有先清理完魔物才能看见前面情况了",position=1,expression=""},
	[17301] = {id=17301,storyid=173,pos=1,description="冥界之门还好还没有被这些魔物攻破，蝎神应该还在冥界看守阿波菲斯",position=2,expression=""},
	[17401] = {id=17401,storyid=174,pos=1,description="想要联系上她就必须打开冥界之门，可惜开启冥界之门的钥匙之前被魔物趁乱偷走了，我虽然重创了那个魔物，但是它逃掉了",position=2,expression=""},
	[17402] = {id=17402,storyid=174,pos=2,description="我们必须在魔物开启冥界之门之前进入冥界！",position=2,expression=""},
	[17403] = {id=17403,storyid=174,pos=3,description="。。。我们没有钥匙，怎么进得去？",position=1,expression=""},
	[17404] = {id=17404,storyid=174,pos=4,description="我刚观察了你们团队的实力，只要我和你们一起攻击冥界之门，就能强行开启一个通道！虽然马上会关闭，但是足够我们进去冥界了！",position=2,expression=""},
