	[9020101] = {id=9020101,storyid=90201,pos=1,description="切~你又醒了啊~",position=1,expression=""},
	[9020201] = {id=9020201,storyid=90202,pos=1,description="本小姐感受到了有人的呼唤~所以就醒了~",position=1,expression=""},
	[9020301] = {id=9020301,storyid=90203,pos=1,description="你只是被花香唤醒了吧~",position=1,expression=""},
	[9020401] = {id=9020401,storyid=90204,pos=1,description="哎嘿嘿~谁说的~肯定是你呼唤我了~",position=1,expression=""},
	[9030101] = {id=9030101,storyid=90301,pos=1,description="客官，你购买的费用达到了本店的奖励额度~这里有有份礼包送给你~",position=1,expression=""},
	[9030201] = {id=9030201,storyid=90302,pos=1,description="哎~居然还有礼物~快快拿出来~~",position=1,expression=""},
	[9030301] = {id=9030301,storyid=90303,pos=1,description="稍等~~",position=1,expression=""},
	[9040101] = {id=9040101,storyid=90401,pos=1,description="有人在嘛~？",position=1,expression=""},
	[9040201] = {id=9040201,storyid=90402,pos=1,description="有人在~请问你有什么事？",position=1,expression=""},
	[9040301] = {id=9040301,storyid=90403,pos=1,description="听说你们这里需要能力出众的锻造师~本人不才，特来毛遂自荐~",position=1,expression=""},
	[9040401] = {id=9040401,storyid=90404,pos=1,description="好啊~好啊~快来说说你都有拿些能力~~？",position=1,expression=""},
	[9040501] = {id=9040501,storyid=90405,pos=1,description="呃~听说过乱披风锤法没~？不错~这是我最低级的锻造手法~",position=1,expression=""},
	[9040601] = {id=9040601,storyid=90406,pos=1,description="呜~好像在哪里听说过~~算了~听起来好像很厉害的样子~就你了~",position=1,expression=""},
	[9050101] = {id=9050101,storyid=90501,pos=1,description="今天的工作又完成了~",position=1,expression=""},
	[9050101] = {id=9050101,storyid=90501,pos=1,description="感觉自己的能力又得到在大大地提升~！",position=1,expression=""},
	[9060101] = {id=9060101,storyid=90601,pos=1,description="有什么东西在吸引着我~~",position=1,expression=""},
	[9060201] = {id=9060201,storyid=90602,pos=1,description="可恶~没想到对面这么厉害~咱们居然打不过",position=1,expression=""},
	[9060301] = {id=9060301,storyid=90603,pos=1,description="打不过正常，战斗常有胜负，等咱们再提升下自己后再来干他们Y的~",position=1,expression=""},
	[9060401] = {id=9060401,storyid=90604,pos=1,description="李凡说的不错~下次再来碾压他们~",position=1,expression=""},
	[9060501] = {id=9060501,storyid=90605,pos=1,description="咦~你是谁~？",position=1,expression=""},
	[9060601] = {id=9060601,storyid=90606,pos=1,description="我叫衰神，由人间无数的衰气中诞生的~",position=1,expression=""},
	[9060701] = {id=9060701,storyid=90607,pos=1,description="什么~什么~那你为什么来这里~",position=1,expression=""},
	[9060801] = {id=9060801,storyid=90608,pos=1,description="你们身上好像拥有庞大的衰气~所以我被吸引过来了~",position=1,expression=""},
	[9060901] = {id=9060901,storyid=90609,pos=1,description="哎~衰气~那是什么~？",position=1,expression=""},
	[9061001] = {id=9061001,storyid=90610,pos=1,description="衰气就是霉运，比如战斗中，不小心平地摔了；或者攻击别人时，武器突然断了~",position=1,expression=""},
	[9061101] = {id=9061101,storyid=90611,pos=1,description="难道是这样~所以我刚在战斗中平地摔就是因为霉运嘛？可恶~~",position=1,expression=""},
	[9061201] = {id=9061201,storyid=90612,pos=1,description="呃~（那你是平常也平地摔好么~~）",position=1,expression=""},
	[9061301] = {id=9061301,storyid=90613,pos=1,description="你们好像可以源源不断地产生衰气~看来我以后跟着你们了~",position=1,expression=""},
	[9061401] = {id=9061401,storyid=90614,pos=1,description="总感觉有种不好的预感~",position=1,expression=""},
	[9070101] = {id=9070101,storyid=90701,pos=1,description="是你们在使用我的力量嘛~？",position=1,expression=""},
	[9070201] = {id=9070201,storyid=90702,pos=1,description="是的~死神大人~不知大人有什么事情~！",position=1,expression=""},
	[9070301] = {id=9070301,storyid=90703,pos=1,description="嘿嘿~为了奖励你们给我大量的信仰之力，我将让我的化身来帮忙你们~",position=1,expression=""},
	[9070401] = {id=9070401,storyid=90704,pos=1,description="多谢大人，我们会一直献上信仰之力的~",position=1,expression=""},
	[9070501] = {id=9070501,storyid=90705,pos=1,description="恩~不错不错~",position=1,expression=""},
	[9080101] = {id=9080101,storyid=90801,pos=1,description="我又获得了大量的信仰之力，为了奖励你们~请收下这些东西~",position=1,expression=""},
	[9080201] = {id=9080201,storyid=90802,pos=1,description="嘿嘿~",position=1,expression=""},
	[9090101] = {id=9090101,storyid=90901,pos=1,description="哎呀~老朽以为今天就要饿死了~",position=1,expression=""},
	[9090201] = {id=9090201,storyid=90902,pos=1,description="小伙们都是善良之辈啊~看来有必要将我祖传的东西拿出来送给你们~",position=1,expression=""},
	[9090301] = {id=9090301,storyid=90903,pos=1,description="这位小伙骨骼精奇，想必定是练武奇材，这里有本如来神掌，只要998，呸~为了感谢你们，我就送给你们了~",position=1,expression=""},
	[9090401] = {id=9090401,storyid=90904,pos=1,description="呃~什么东西~（下次就当费钱卖了吧~）",position=1,expression=""},
	[9090501] = {id=9090501,storyid=90905,pos=1,description="哈哈~就这样，老朽走了~",position=1,expression=""},
