	[9100201] = {id=9100201,storyid=91002,pos=1,description="是啊~是啊~还是小伙你们好啊~我差点又饿死了~",position=1,expression=""},
	[9100301] = {id=9100301,storyid=91003,pos=1,description="这个给你们算是饭钱了~哈哈老朽走也~~",position=1,expression=""},
	[9100401] = {id=9100401,storyid=91004,pos=1,description="呃~怎么看都不像是要饿死的样子啊~~",position=1,expression=""},
	[9110101] = {id=9110101,storyid=91101,pos=1,description="传说中有个食物闻起来奇臭无比，但是慢慢细闻后又会发现并不是臭，而是一种说不上来的气味~",position=1,expression=""},
