	[9110301] = {id=9110301,storyid=91103,pos=1,description="哈哈~这位史台谬赞了，这只是简单的小吃~",position=1,expression=""},
	[9110401] = {id=9110401,storyid=91104,pos=1,description="原来如此~看来是我孤陋寡闻了~不知能否让我留下学习这道菜~",position=1,expression=""},
	[9110501] = {id=9110501,storyid=91105,pos=1,description="当然~非常欢迎~",position=1,expression=""},
	[9120101] = {id=9120101,storyid=91201,pos=1,description="越吃越觉得这是美味啊~！",position=1,expression=""},
	[9120201] = {id=9120201,storyid=91202,pos=1,description="是及是及~必须点32个赞~",position=1,expression=""},
	[9120301] = {id=9120301,storyid=91203,pos=1,description="不错~这么神奇的美味必须推广向全世界~",position=1,expression=""},
	[9130101] = {id=9130101,storyid=91301,pos=1,description="非常感谢你们的帮助~差点就淹死在海上了~",position=1,expression=""},
	[9130201] = {id=9130201,storyid=91302,pos=1,description="发生了什么，为什么你漂浮在海上~",position=1,expression=""},
	[9130301] = {id=9130301,storyid=91303,pos=1,description="我是从附近的伐木岛逃出来的，突然岛上来了一大波海盗~我害怕被捉住就跑出来了。",position=1,expression=""},
	[9130401] = {id=9130401,storyid=91304,pos=1,description="伐木岛嘛~那里的海盗已经被我们清理干净了~",position=1,expression=""},
	[9130501] = {id=9130501,storyid=91305,pos=1,description="真的嘛~那我加入你们吧~我可以帮你们继续伐木，只要有口饭吃就行~",position=1,expression=""},
	[9130601] = {id=9130601,storyid=91306,pos=1,description="好吧~（感觉好凄凉的样子~~）",position=1,expression=""},
	[9140101] = {id=9140101,storyid=91401,pos=1,description="这里的野兽的真多~差点就被吃了~",position=1,expression=""},
	[9140201] = {id=9140201,storyid=91402,pos=1,description="剩下的野兽我们来解决~你休息一下~",position=1,expression=""},
	[9140301] = {id=9140301,storyid=91403,pos=1,description="好的~",position=1,expression=""},
	[9150101] = {id=9150101,storyid=91501,pos=1,description="这里的野兽的真多~差点就被吃了~",position=1,expression=""},
	[9150201] = {id=9150201,storyid=91502,pos=1,description="剩下的野兽我们来解决~你休息一下~",position=1,expression=""},
	[9150301] = {id=9150301,storyid=91503,pos=1,description="好的~",position=1,expression=""},
	[9160101] = {id=9160101,storyid=91601,pos=1,description="我要死了~已经七天七夜没有吃喝了~",position=1,expression=""},
	[9160201] = {id=9160201,storyid=91602,pos=1,description="哎呀~放心你还死不了，这不我们刚好带了吃喝~",position=1,expression=""},
	[9160301] = {id=9160301,storyid=91603,pos=1,description="谢天谢地，请给我吃的喝的，我愿意做任何事~",position=1,expression=""},
	[9160401] = {id=9160401,storyid=91604,pos=1,description="（哦~好像缺少挖掘的~嘿嘿），没问题~你先吃吧~等吃好了咱们再讨论要做什么~",position=1,expression=""},
	[9160501] = {id=9160501,storyid=91605,pos=1,description="呜呜~呜呜~感觉自己活过来了~",position=1,expression=""},
	[9160601] = {id=9160601,storyid=91606,pos=1,description="请收下我吧~今后我是你的人了~~",position=1,expression=""},
