	[7] = {id=7,name="尖刺猎手",icon="01_haidaolieshou.png",describe="强盗组织的基层强盗射手，擅长远距离使用猎枪作战。一个好的猎手需要一杆好枪，但大部分海盗猎手并没有一把像样的枪，所以用他们总说这样一句话：“是硬件跟不上，不是我瞄不准。”",enemy_phyle="人类 ",enemy_type=0,appear_place="1111",enemy_hp=1,enemy_att=1.5,enemy_def=1.5,enemy_mdef=1,enemy_skill="72030101101"},
