	[11] = {id=11,name="尖刺炮手",icon="01_haidaopaoshou.png",describe="强盗组织的炮手，在强盗攻城战的时候，是必不可少的战力。",enemy_phyle="人类 ",enemy_type=0,appear_place="1121",enemy_hp=1,enemy_att=1.5,enemy_def=1.5,enemy_mdef=1,enemy_skill="72030103201"},
	[12] = {id=12,name="偷粮小贼",icon="01_touliangxiaoze.png",describe="不知从何而来的神秘的小偷。",enemy_phyle="人类 ",enemy_type=0,appear_place="666001",enemy_hp=2.5,enemy_att=3.5,enemy_def=2.5,enemy_mdef=2.5,enemy_skill="72010115101"},
	[13] = {id=13,name="尖刺恶犬",icon="01_jianciequanjy.png",describe="强盗组织圈养的恶犬。在强盗血洗村庄的时候，是强盗集团的得力助手，在面对敌人的时候，会无情的撕咬目标。",enemy_phyle="动物",enemy_type=0,appear_place="1051",enemy_hp=1,enemy_att=2,enemy_def=1,enemy_mdef=1,enemy_skill="72010116101"},
	[14] = {id=14,name="精英恶犬",icon="01_jianciequanjy.png",describe="强盗组织圈养的精锐恶犬。在强盗血洗村庄的时候，是强盗集团的得力助手，巨大的爪子能拍晕靠近的敌人。当它带领一小队恶犬战斗的时候，能集合成一股非常强大的战力。",enemy_phyle="动物",enemy_type=2,appear_place="1051",enemy_hp=3,enemy_att=3,enemy_def=3.5,enemy_mdef=2.5,enemy_skill="72010118101|72010118201|72010118301|72010102401"},
	[15] = {id=15,name="猎王",icon="01_liewang.png",describe="强盗组织的二把手，做事以心狠手辣出名。曾经有过一人击倒一整个舰队的伟大战绩，但最近因为年纪比较大了总是犯迷糊而被大头目责骂。",enemy_phyle="人类 ",enemy_type=1,appear_place="1111",enemy_hp=2.5,enemy_att=3,enemy_def=3,enemy_mdef=2.5,enemy_skill="72030104101|72030106201|72030106101|72030105101"},
	[16] = {id=16,name="胖子首领",icon="01_pangzishouling.png",describe="强盗组织的先锋队队长。浑身上下充满了肥肉，再配合自身高大的身躯，会给敌人毁灭的打击。",enemy_phyle="人类 ",enemy_type=2,appear_place="1121",enemy_hp=3.5,enemy_att=2.5,enemy_def=3.5,enemy_mdef=3.5,enemy_skill="72010109301|72010108201|72010109101|72010109201"},
	[17] = {id=17,name="武术教头",icon="01_wushujiaotou.png",describe="强盗组织的教官。所有海盗的战斗技巧都是出自他的教导。体魄非常强大，并且有很强的进攻性，是强盗头目手下一员得力干将。绝招“毁灭三刀” 的爆发力不容小觑（其实是四刀）。",enemy_phyle="人类 ",enemy_type=2,appear_place="1121",enemy_hp=3,enemy_att=3,enemy_def=3.5,enemy_mdef=2.5,enemy_skill="72010104301|72010104401|72010104101|72010102401"},
	[18] = {id=18,name="首席技师",icon="01_shouxijishi.png",describe="强盗组织的技术代表。自诩为炮弹技术的天才，提供制作了强盗组织里大部分的火炮。自己研发的超级大炮威力不凡，可是射程较短实在是个问题。",enemy_phyle="人类 ",enemy_type=2,appear_place="1121",enemy_hp=2.5,enemy_att=3,enemy_def=2.5,enemy_mdef=3,enemy_skill="72030103201|72030103301|72030103401"},
	[19] = {id=19,name="尖刺头目",icon="01_jiancitoumu.png",describe="强盗组织的基层头目。是在海上有名的大海贼，为了钱什么都能做出来。虽然是女性，但爆裂的性格比凶猛的老虎还要可怕，强盗集团里没有人敢惹怒这位大头目。手里的双头斧据说要三个成年男性才能抬得动，在发怒时挥舞斧头能摧毁附近的所有敌人。",enemy_phyle="人类 ",enemy_type=1,appear_place="1121",enemy_hp=4.5,enemy_att=4.5,enemy_def=5,enemy_mdef=4,enemy_skill="72010112301|72010112201|72010113101"},
	[20] = {id=20,name="士兵亡魂",icon="01_shibingwanghun.png",describe="克诺斯王国的骑士，在抵御强盗的入侵的时候战败身亡变成了亡魂，终日徘徊在塔楼中。不喜欢有人打扰公主的领地，善于突击进攻。",enemy_phyle="幽灵",enemy_type=0,appear_place="1061",enemy_hp=1.5,enemy_att=1.5,enemy_def=2,enemy_mdef=1,enemy_skill="72010123101"},
	[21] = {id=21,name="骑士亡魂",icon="01_qishiwanghun.png",describe="克诺斯王国的骑士，在抵御强盗的入侵的时候战败身亡变成了亡魂，终日徘徊在塔楼中。不喜欢有人打扰公主的领地，善于防守反击。",enemy_phyle="幽灵",enemy_type=2,appear_place="1061",enemy_hp=2,enemy_att=1,enemy_def=2,enemy_mdef=2,enemy_skill="72010125101|72010125201"},
