	[26] = {id=26,name="菲安娜的亡魂",icon="01_feiannadewanghun.png",describe="克诺斯王国的公主，在王国战败后自杀身亡，变成了亡魂居住在这里。精通各种法术，擅长治疗和召唤系法术。激怒她可不是个好的决定。",enemy_phyle="幽灵",enemy_type=1,appear_place="1081",enemy_hp=4.5,enemy_att=4,enemy_def=4.5,enemy_mdef=4.5,enemy_skill="72040102101|72040102401|72040102201|72040102301"},
	[27] = {id=27,name="魔化饥民男",icon="02_niminnanmo.png",describe="女性饥民在吃了污染食物后受到了感染，变成了魔化饥民女。由于身体结构发生了改变，已经不能像正常人一样站立行走了。趴下行走的她放弃了防御，所以更具攻击力，会对人进行无差别的攻击。",enemy_phyle="魔物",enemy_type=0,appear_place="2501",enemy_hp=1.5,enemy_att=1.5,enemy_def=2,enemy_mdef=1,enemy_skill="72010203201|72010203301"},
	[28] = {id=28,name="魔化饥民女",icon="02_jiminnvmo.png",describe="男性饥民在吃了污染食物后受到了感染，变成了魔化饥民男。由于身体结构发生了改变，他身上的皮肤变得极其坚硬，普通的刀剑对他的伤害十分有限。",enemy_phyle="魔物",enemy_type=0,appear_place="2501",enemy_hp=1,enemy_att=1.5,enemy_def=1.5,enemy_mdef=1,enemy_skill="72030201201|72030201301"},
	[29] = {id=29,name="豌豆饥民",icon="02_wandou.png",describe="饥民在吃了污染豌豆后受到了感染，变成了豌豆饥民怪物。由于身体结构发生了改变，头部变成了豌豆，会对人进行无差别的攻击。",enemy_phyle="魔物",enemy_type=2,appear_place="2501",enemy_hp=2.5,enemy_att=3,enemy_def=3,enemy_mdef=2.5,enemy_skill="72030202201"},
	[30] = {id=30,name="南瓜饥民",icon="02_nangua.png",describe="饥民在吃了污染南瓜后受到了感染，变成了南瓜饥民怪物。由于身体结构发生了改变，头部变成了南瓜，会对人进行无差别的攻击。",enemy_phyle="魔物",enemy_type=2,appear_place="2501",enemy_hp=3.5,enemy_att=2.5,enemy_def=3.5,enemy_mdef=3.5,enemy_skill="72010204201|72010204301"},
	[31] = {id=31,name="辣椒饥民",icon="02_lajiao.png",describe="饥民在吃了污染辣椒后受到了感染，变成了辣椒饥民怪物。由于身体结构发生了改变，头部变成了辣椒，会对人进行无差别的攻击。",enemy_phyle="魔物",enemy_type=2,appear_place="2501",enemy_hp=2.5,enemy_att=3.5,enemy_def=2.5,enemy_mdef=2.5,enemy_skill="72020201201|72020201301"},
	[32] = {id=32,name="食人花饥民",icon="02_shirenhua.png",describe="饥民在吃了污染食人花后受到了感染，变成了食人花饥民怪物。由于身体结构发生了改变，头部变成了食人花，会对人进行无差别的攻击。",enemy_phyle="魔物",enemy_type=2,appear_place="2501",enemy_hp=3,enemy_att=3,enemy_def=3.5,enemy_mdef=2.5,enemy_skill="72010205101|72010205201"},
	[33] = {id=33,name="厨师长",icon="02_chushizhang.png",describe="美食镇的顶级大厨，受到了魔化食物的影响而被邪恶势力控制住了。其出神入化的厨艺使许多的美食镇的镇民在大快朵颐之时便受到了感染。身体强壮、刀工出神入他在战斗方面也有不俗的实力。千万不要因为他厨师的身份而轻敌。上一个轻视厨师长的人已经变成了他手中的一道菜了。",enemy_phyle="魔物",enemy_type=2,appear_place="2081",enemy_hp=3.5,enemy_att=2.5,enemy_def=3.5,enemy_mdef=3.5,enemy_skill="72010202201|72010202601|72010202401|72010202501"},
	[34] = {id=34,name="暴食",icon="02_baoshi.png",describe="原来是美食镇的镇长。他从玛雅岛附近打捞起了一块散发着绿光的护符，这块护符有种神奇的魔力。镇长沉浸于这块魔石带来的力量，沉迷于研究的他身体发生了变异。但这并没有消减他的研究热情，反而给他开辟了新的研究方向。从致力于改善人民生活的研究路线变成了如何传播污染、改造人类的研究路线。",enemy_phyle="魔物",enemy_type=1,appear_place="2501",enemy_hp=5,enemy_att=4,enemy_def=5,enemy_mdef=5,enemy_skill="72010201201|72010201301|72010201401|72010201701"},
	[35] = {id=35,name="瘟疫老鼠",icon="02_wenyilaoshu.png",describe="老鼠在吃了污染食物后受到了感染，发生了魔化。由于身体结构发生了改变，老鼠的体积变得十分巨大，会对人进行无差别的攻击。",enemy_phyle="动物",enemy_type=2,appear_place="2501",enemy_hp=3,enemy_att=3,enemy_def=3.5,enemy_mdef=2.5,enemy_skill="72010206201"},
	[36] = {id=36,name="瘟疫蝙蝠",icon="02_wenyibianfu.png",describe="海贼魔法师饲养的蝙蝠。身体极其敏捷，很难被普通攻击所击中。被它撕咬的人会受到感染。单个的蝙蝠并不可怕，但这些小东西总是成群出现。",enemy_phyle="动物",enemy_type=0,appear_place="2501",enemy_hp=1,enemy_att=2,enemy_def=1,enemy_mdef=1,enemy_skill="72010207201|72010207301"},
	[37] = {id=37,name="海盗刀",icon="00_jianciqiangdao.png",describe="海贼组织中的战士。一脸大胡子让人感觉十分凶狠，挥舞的斧子能轻易砍开你的脑袋。因为武器是斧子的原因他同时还身兼海贼组织里的伐木工，所以他最近正在考虑换一个武器。",enemy_phyle="人类 ",enemy_type=0,appear_place="2011",enemy_hp=2,enemy_att=1,enemy_def=2,enemy_mdef=2,enemy_skill="72010208201"},
	[38] = {id=38,name="海贼召唤使",icon="00_jiancifashi.png",describe="海贼组织的魔法师。有着高超的法术技巧，喜欢饲养邪恶的蝙蝠作为助手。当他的宠物蝙蝠受到魔化毒物的影响后变成瘟疫蝙蝠后，他更加喜欢这些小宝贝了。所以当你遇到他的时候，你还得面对许多“可爱”的瘟疫蝙蝠。",enemy_phyle="人类 ",enemy_type=0,appear_place="2011",enemy_hp=1,enemy_att=1.5,enemy_def=1,enemy_mdef=1.5,enemy_skill="72040201201"},
	[39] = {id=39,name="隐身海贼",icon="00_jiancidaozei.png",describe="海贼组织中的盗贼，鸡鸭牛羊无所不盗。。",enemy_phyle="人类 ",enemy_type=0,appear_place="2051",enemy_hp=1,enemy_att=2,enemy_def=1,enemy_mdef=1,enemy_skill=""},
