	[75] = {id=75,name="伐木岛-炮手精英",icon="01_shouxijishi.png",describe="强盗组织的炮手，在强盗攻城战的时候，是必不可少的战力。",enemy_phyle="人类 ",enemy_type=0,appear_place="667001",enemy_hp=2.5,enemy_att=3,enemy_def=2.5,enemy_mdef=3,enemy_skill="72030103201|72030103301|72030103401"},
	[76] = {id=76,name="伐木岛-猎手",icon="01_haidaolieshou.png",describe="强盗组织的基层强盗射手，擅长远距离使用猎枪作战。一个好的猎手需要一杆好枪，但大部分海盗猎手并没有一把像样的枪，所以用他们总说这样一句话：“是硬件跟不上，不是我瞄不准。”",enemy_phyle="人类 ",enemy_type=0,appear_place="667001",enemy_hp=2.5,enemy_att=3,enemy_def=3,enemy_mdef=2.5,enemy_skill="72030101101"},
	[77] = {id=77,name="伐木岛-武术教头",icon="01_wushujiaotou.png",describe="强盗组织的教官。所有海盗的战斗技巧都是出自他的教导。体魄非常强大，并且有很强的进攻性，是强盗头目手下一员得力干将。绝招“毁灭三刀” 的爆发力不容小觑（其实是四刀）。",enemy_phyle="人类 ",enemy_type=2,appear_place="667001",enemy_hp=4.5,enemy_att=4.5,enemy_def=5,enemy_mdef=4,enemy_skill="72010104301|72010104401|72010104101|72010102401"},
	[78] = {id=78,name="伐木岛-长毛蜘蛛",icon="01_changmaozhizhu.png",describe="生活在岩洞中的蜘蛛。浑身长满了白色的毛，令人毛骨悚然。长毛蜘蛛擅长吐出丝缠绕入侵者，然后慢慢蚕食目标。遇到他们还是第一时间逃跑吧。",enemy_phyle="人类 ",enemy_type=0,appear_place="667001",enemy_hp=1,enemy_att=1.5,enemy_def=1.5,enemy_mdef=1,enemy_skill="72030111201"},
	[79] = {id=79,name="伐木岛-毒蜘蛛",icon="01_duzhizhu.png",describe="生活在岩洞中的蜘蛛，浑身淬满了绿色的毒液。遭遇它的时候千万不要戴帽子，倒不是帽子会激怒它，只是它的毒液染绿了你的帽子就不好了。",enemy_phyle="动物",enemy_type=0,appear_place="667001",enemy_hp=1,enemy_att=1.5,enemy_def=1.5,enemy_mdef=1,enemy_skill="72030110101"},
